(window["webpackJsonp"]=window["webpackJsonp"]||[]).push([["era~species"],{"37aa":function(e){e.exports={id:"birds",evolution_data:[{period:"Jurassic",upper:"201 Mya",lower:"145 Mya",data:[{name:["Archaeopteryx","bird","dinosaur"],description:' Archaeopteryx was the "original bird" or "first bird".  They were bird-like dinosaurs that is transitional between non-avian feathered dinosaurs and modern birds. Archaeopteryx lived in the Late Jurassic around 150 million years ago. \n Despite their small size, broad wings, and inferred ability to fly or glide, Archaeopteryx had more in common with other small Mesozoic dinosaurs than with modern birds. In particular, they shared the following features with the dromaeosaurids and troodontids: jaws with sharp teeth, three fingers with claws, a long bony tail, hyperextensible second toes ("killing claw"), feathers (which also suggest warm-bloodedness), and various features of the skeleton. ',url:"https://ichef.bbci.co.uk/images/ic/720x405/p06ptdq8.jpg"}]},{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:"Confuciusornis",description:"Confuciusornis is a genus of primitive crow-sized birds from the Early Cretaceous Period of the Yixian and Jiufotang Formations of China, dating from 125 to 120 million years ago. Like modern birds, Confuciusornis had a toothless beak, but close relatives of modern birds such as Hesperornis and Ichthyornis were toothed, indicating that the loss of teeth occurred convergently in Confuciusornis and living birds. \n It is the oldest known bird to have a beak.",url:"https://upload.wikimedia.org/wikipedia/commons/8/87/Confuciusornis_male.jpg"},{name:"Confuciusornithidae",description:" Confuciusornithidae is an extinct family of early birds known from the Early Cretaceous, found in northern China. They are descended from theropod dinosaurs and appeared about 27 million years after the genus Archaeopteryx, the first discovered transitional dinosaur between dinosaurs and birds. They are commonly placed as a sister group to Ornithothoraces, a group that contains all extant birds along with their closest extinct relatives. Confuciusornithidae consists of four genera, with type-specimens possessing both shafted and non-shafted (downy) feathers. They are also noted for their distinctive pair of ribbon-like tail feathers of disputed function. \n  Their wing anatomy also suggests a lack of flapping ability. Confusiusornithids are also noted for their beak and lack of teeth, similar to modern birds.",url:"http://images.dinosaurpictures.org/Confuciusornis_big_0e3a.jpg"},{name:"Iberomesornis",description:'Iberomesornis (meaning "Iberian=Spanish intermediate bird") was a small, early, toothed bird that lived during the early Cretaceous period. It was capable of powered flight. It had tiny, spiky teeth in its beak and was the size of a sparrow. Its hip was primitive compared to modern birds; its ilium, ischium, and pubis were all parallel and directed backward. ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/8/89/Iberomesornis-model.jpg/220px-Iberomesornis-model.jpg"},{name:"Eoalulavis",description:"Eoalulavis lived during the Barremian, in the Lower Cretaceous around 125 million years ago. The only known species is Eoalulavis hoyasi. Eoalulavis was the earliest bird that had good maneuverability while flying, even at low speeds (this extra flight control is obtained from a tuft of feathers on the thumb called the alula - it also helps in takeoffs and landings).",url:"https://vignette.wikia.nocookie.net/fossil/images/5/59/Eoalulavis_.png/revision/latest?cb=20151215234558"},{name:"Hesperornis",description:'Hesperornis (meaning "western bird") was an early, flightless bird that lived during the late Cretaceous period. This diving bird was about 3 feet (1 m) long and had webbed feet, a long, toothed beak, and strong legs. Although it couldn\'t fly, Hesperornis was probably a strong swimmer and likely lived near coastlines and ate fish.',url:"https://i5.walmartimages.com/asr/06f3d685-db21-4f1d-96f7-13eeaacc5a5f_1.ab6abbb7518e0fc1cc0ff9fd927cba11.jpeg?odnHeight=450&odnWidth=450&odnBg=FFFFFF"},{name:"Ichthyornis",description:'Ichthyornis (meaning "fish bird") were 8 inch (20 cm) long, toothed, tern-like, extinct bird that date from the late Cretaceous period. It had a large head and beak. This powerful flyer is the oldest-known bird that had a keeled breastbone (sternum) similar to that of modern birds. It lived in flocks nesting on shorelines, and hunted for fish over the seas.',url:"http://www.dododex.com/media/creature/ichthyornis.png"},{name:"Mononykus",description:' Mononykus (meaning "single claw") was a small, insect-eater from the Late Cretaceous period, about 72 million years ago. Mononykus was either a bird-like dinosaur (an advanced theropod) or a primitive bird; it possessed qualities of both groups of animals, and there is much scientific debate over which it is. Mononykus had short arms with one long, thick clawed finger on each hand (hence its name). It was lightly built, had long, thin legs.',url:"http://www.dinosaur-world.com/feathered_dinosaurs/species/mononykus_olecranus.gif"}]},{period:"Cenozoic",upper:"66 Mya",lower:"present",data:[{name:["Phorusrhacids","terror birds"],description:"Phorusrhacids, colloquially known as terror birds, are an extinct clade of large carnivorous flightless birds that were the largest species of apex predators in South America during the Cenozoic era; their temporal range covers from 62 to 1.8 million years (Ma) ago. \n Most phorusrhacids were very fast runners. All members possessed a large, sharp beak, a powerful neck and sharp talons. However, even with these attributes, the phorusrhacids are often assumed to have preyed on relatively small animals (about the size of a rabbit) that could be dispatched with a minimum of struggle. This is due to the fact that with the phorusrhacids' beak proportions, the jaw could not generate a great deal of bite force with which to kill the prey. ",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/5/5a/Llallawavis_scagliai.jpg/220px-Llallawavis_scagliai.jpg"},{name:"Gastornis",description:"Gastornis is an extinct genus of large flightless birds that lived during the late Paleocene and Eocene epochs of the Cenozoic era.\n Gastornis species were very large birds, and have traditionally been considered to be predators of small mammals. However, several lines of evidence, including the lack of hooked claws in known Gastornis footprints and studies of their beak structure have caused scientists to reinterpret these birds as herbivores that probably fed on tough plant material and seeds.",url:"https://www.newdinosaurs.com/wp-content/uploads/2016/11/681_gastornis_smnt2000.jpg"},{name:["Anatalavis","ducks","geese"],description:"Anatalavis is genus of prehistoric birds related to ducks and geese, perhaps in particular the magpie-goose. The species Anatalavis rex – formerly placed in Telmatornis – is known from the Hornerstown Formation (Late Cretaceous or Early Paleocene, some 66 million years ago) of New Jersey.",url:"https://upload.wikimedia.org/wikipedia/commons/0/03/Magpie_Goose_taking_off.jpg"},{name:["Odontopteryx","pelicans","storks"],description:'Odontopteryx is a genus of the prehistoric pseudotooth birds or pelagornithids. These were probably rather close relatives of either pelicans and storks, or of waterfowl, and are here placed in the order Odontopterygiformes to account for this uncertainty. \n O. toliapica is among the smallest pseudotooth birds known to date – but this still means that to would have rivalled, if not exceeded, most living albatrosses in wingspan and the brown pelican (Pelecanus occidentalis) in bulk. In life, its head (including the beak) would have been 20–25 cm (8–10 in) long. Unlike in most other pseudotooth birds, its "teeth" are slanted forwards.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/c/ce/Odontopteryx.jpg/220px-Odontopteryx.jpg"},{name:["Palaeognathae","flightless birds","kiwis","ostriches","emus","rheas"],description:"No unambiguously paleognathous fossil birds are known until the Cenozoic. Paleognathes share a pattern of grooves in the horny covering of the bill. This covering is called the rhamphotheca. The paleognath pattern has one central strip of horn, with long, triangular, strips to either side. Paleognaths as a whole tend to have proportionally small brains, and are among the living birds with the most limited cognitive abilities. Kiwis are exceptional, however, and have large brains comparable to those of parrots and songbirds, though evidence for similar levels of behaviour complexity are currently lacking.",url:"https://vignette.wikia.nocookie.net/allbirdsoftheworld/images/a/a5/Palaeognathae_diversity.png/revision/latest?cb=20161121002948"},{name:["Neognathae","living birds","pigeons","owls","sparrow","parrots"],description:'The Neognathae include virtually all living birds; exceptions being their sister taxon (Palaeognathae), which contains the tinamous and the flightless ratites. There are nearly 10,000 species of neognaths. The neognaths have fused metacarpals, an elongate third finger, and 13 or fewer vertebrae. They differ from the Palaeognathae in features like the structure of their jawbones. "Neognathae" means "new jaws" ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6e/Passer_domesticus_male_%2815%29.jpg/220px-Passer_domesticus_male_%2815%29.jpg"}]}]}},6983:function(e){e.exports={id:"human",evolution_data:[{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:"Plesiadapis",description:" An early stem-primate, Plesiadapis, still had claws and eyes on the side of the head, making it faster on the ground than in the trees, but it began to spend long times on lower branches, feeding on fruits and leaves.",url:"https://upload.wikimedia.org/wikipedia/commons/c/ca/Plesiadapis2.jpg"}]},{period:"Paleocene",upper:"66 Mya",lower:"54.8 Mya",data:[{name:"Strepsirrhini",description:'Strepsirrhini or Strepsirhini is a suborder of primates that includes the lemuriform primates, which consist of the lemurs of Madagascar, galagos ("bushbabies") and pottos from Africa, and the lorises from India and southeast Asia. Strepsirrhines are defined by their "wet" (moist) rhinarium (the tip of the snout) - hence the colloquial but inaccurate term "wet-nosed" ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/66/Suborder_Strepsirrhini.jpg/220px-Suborder_Strepsirrhini.jpg"},{name:"Haplorrhini",description:' Haplorhini (the haplorhines or the "dry-nosed" primates, the Greek name means "simple-nosed") is a suborder of primates containing the three living groups: prosimian tarsiers, simian monkeys, and apes. One of the earliest haplorrhines is Teilhardina asiatica, a mouse-sized, diurnal creature with small eyes. The Haplorrhini metabolism lost the ability to produce vitamin C, forcing all descendants to include vitamin C-containing fruit in their diet. ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/0/09/Totenkopfaeffchen.jpg/320px-Totenkopfaeffchen.jpg"}]},{period:"Eocene",upper:"54.8 Mya",lower:"33.7 Mya",data:[{name:"Simians",description:"The simians (infraorder Simiiformes) or Anthropoids are the monkeys, incl. apes, cladistically including: the New World monkeys or platyrrhines, and the Catarrhine clade consisting of the Cercopithecidae and apes (including humans). The simians are sister to the tarsiers, together forming the Haplorhines.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/46/Old_%26_New_World_monkey_faces.JPG/640px-Old_%26_New_World_monkey_faces.JPG"},{name:"Platyrrhini",description:"Platyrrhines, New World monkeys, have prehensile tails and males are color blind. Platyrrhini means flat-nosed, and their noses are flatter than those of other simians, with sideways-facing nostrils. The individuals whose descendants would become Platyrrhini are conjectured to have migrated to South America either on a raft of vegetation or via a land bridge (the hypothesis now favored).",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/dc/BrownSpiderMonkey_%28edit2%29.jpg/428px-BrownSpiderMonkey_%28edit2%29.jpg"},{name:"Catarrhini",description:"Catarrhini is one of the two subdivisions of the higher primates (the other is the New World monkeys). Catarrhines include the Old World monkeys and the apes. Apes are further divided into the lesser apes or gibbons and the great apes, consisting of the orangutans, gorillas, chimpanzees, and humans. They are all native to Africa and Asia.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/1/14/Macaca_arctoides.png/640px-Macaca_arctoides.png"}]},{period:"Oligocene",upper:"33.7 Mya",lower:"23.8 Mya",data:[{name:"Old World monkey",description:"Catarrhini splits into 2 superfamilies, Old World monkeys (Cercopithecoidea) and apes (Hominoidea). The Old World monkeys is the common English name for a family of primates known taxonomically as the Cercopithecidae. Twenty-four genera and 138 species are recognized, making it the largest primate family. Old World monkey genera include baboons (genus Papio) and macaques (genus Macaca)'. Common names for other Old World monkeys include the talapoin, guenon, colobus, douc (douc langur, genus Pygathrix), vervet, gelada, mangabey (a group of genera), langur, mandrill, surili (sp. Presbytis), patas, and proboscis monkey. ",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/35/Olive_baboon_Ngorongoro.jpg/528px-Olive_baboon_Ngorongoro.jpg"},{name:"Hominoidea",description:'Catarrhini splits into 2 superfamilies, Old World monkeys (Cercopithecoidea) and apes (Hominoidea). Apes (Hominoidea) are a branch of Old World tailless simians native to Africa and Southeast Asia. They are the sister group of the Old World monkeys, together forming the catarrhine clade. They are distinguished from other primates by a wider degree of freedom of motion at the shoulder joint as evolved by the influence of brachiation. In traditional and non-scientific use, the term "ape" excludes humans, and is thus not equivalent to the scientific taxon Hominoidea. ',url:"https://classconnection.s3.amazonaws.com/40/flashcards/4879040/jpg/mountain-gorillas-148BF6232DF7CE7ED94-thumb400.jpg"},{name:"Proconsul",description:"Proconsul is an extinct genus of primates that existed from 23 to 25 million years ago.  Fossil remains are present in Eastern Africa including Kenya and Uganda. Proconsul was an early genus of catarrhine primates. They had a mixture of Old World monkey and ape characteristics. Proconsul's monkey-like features include thin tooth enamel, a light build with a narrow chest and short forelimbs, and an arboreal quadrupedal lifestyle. Its ape-like features are its lack of a tail, ape-like elbows, and a slightly larger brain relative to body size. Proconsul africanus is a possible ancestor of both great and lesser apes, including humans. ",url:"https://upload.wikimedia.org/wikipedia/commons/8/84/Proconsul_NT.jpg"}]},{period:"Miocene",upper:"23.8 Mya",lower:"5.3 Mya",data:[{name:"Hominidae",description:"Hominidae (great ape ancestors) speciate from the ancestors of the gibbon (lesser apes). The Hominidae , whose members are known as great apes or hominids, are a taxonomic family of primates that includes eight extant species in four genera: Pongo, the Bornean, Sumatran and Tapanuli orangutan; Gorilla, the eastern and western gorilla; Pan, the common chimpanzee and the bonobo; and Homo, which includes modern humans and its extinct relatives (e.g., the Neanderthal), and ancestors, such as Homo erectus.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/41/Hominidae_%28extant_species%29.jpg/432px-Hominidae_%28extant_species%29.jpg"},{name:"Pierolapithecus catalaunicus",description:"Pierolapithecus catalaunicus is thought to be a common ancestor of humans and the other great apes, or at least a species that brings us closer to a common ancestor than any previous fossil discovery. It had the special adaptations for tree climbing as do present-day humans and other great apes: a wide, flat rib cage, a stiff lower spine, flexible wrists, and shoulder blades that lie along its back.",url:"https://upload.wikimedia.org/wikipedia/commons/b/b9/Pierolapithecus_catalaunicus_%28Pau%29_a_l%27Institut_Catal%C3%A0_de_Paleontologia_Miquel_Crusafont.JPG"},{name:"Pan (genus)",description:"The genus Pan consists of two extant species: the common chimpanzee and the bonobo. The genus Pan is part of the subfamily Homininae, to which humans also belong. The lineages of chimpanzees[dubious – discuss] and humans separated in a process of speciation between roughly five to twelve million years ago, making them humanity's closest living relative.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3f/Composite_image_of_male_chimpanzee_%28left%29_and_male_bonobo_%28right%29.jpg/640px-Composite_image_of_male_chimpanzee_%28left%29_and_male_bonobo_%28right%29.jpg"},{name:"Sahelanthropus tchadensis",description:'Sahelanthropus tchadensis is an extinct species of the Hominini and is probably the ancestor to Orrorin that is dated to about 7 million years ago, during the Miocene epoch, possibly very close to the time of the chimpanzee–human divergence. Few specimens other than the partial skull, nicknamed Toumaï ("hope of life"), are known.',url:"https://upload.wikimedia.org/wikipedia/commons/7/7a/SahelanthropusCL.png"},{name:"Ardipithecus kadabba",description:'Ardipithecus kadabba is the scientific classification given to fossil remains "known only from teeth and bits and pieces of skeletal bones," originally estimated to be 5.8 to 5.2 million years old, and later revised to 5.77 to 5.54 million years. According to the first description, these fossils are close to the common ancestor of chimps and humans. ',url:"https://upload.wikimedia.org/wikipedia/commons/f/ff/Ardipithecus_kadabba_fossils.jpg"}]},{period:"Pliocene",upper:"5.3 Mya",lower:"1.8 Mya",data:[{name:"Ardipithecus ramidus",description:"Ardipithecus ramidus is a species of hominin classified as an australopithecine of the genus Ardipithecus. A. ramidus had a small brain, measuring between 300 and 350 cm3. This is about the same size as the modern bonobo and female common chimpanzee brain; it is much smaller than the brain of australopithecines like Lucy (400 to 550 cm3) and slightly over a fifth the size of the modern Homo sapiens brain.",url:"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ardi.jpg"},{name:"Australopithecus afarensis",description:"A member of the Australopithecus afarensis left human-like footprints on volcanic ash in Laetoli, Kenya (Northern Tanzania), providing strong evidence of full-time bipedalism. Australopithecus afarensis lived between 3.9 and 2.9 million years ago, and is considered one of the earliest hominins—those species that developed and comprised the lineage of Homo and Homo's closest relatives after the split from the line of the chimpanzees. It is thought that A. afarensis was ancestral to both the genus Australopithecus and the genus Homo. Compared to the modern and extinct great apes, A. afarensis had reduced canines and molars, although they were still relatively larger than in modern humans.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Australopithecus_afarensis_new.JPG/440px-Australopithecus_afarensis_new.JPG"},{name:"Kenyanthropus platyops",description:"Kenyanthropus platyops is a 3.5 to 3.2-million-year-old (Pliocene) hominin fossil. Kenyanthropus platyops, a possible ancestor of Homo, emerges from the Australopithecus. Stone tools are deliberately constructed.",url:"https://upload.wikimedia.org/wikipedia/commons/2/2c/Kenyanthropus_platyops%2C_skull_%28model%29.JPG"},{name:"Australopithecus",description:"Australopithecus apparently evolved in eastern Africa around 4 million years ago before spreading throughout the continent and eventually becoming extinct two million years ago. Australopithecus species played a significant part in human evolution, the genus Homo being derived from Australopithecus at some time after three million years ago. In addition, they were the first hominids to possess certain genes, known as the duplicated SRGAP2, which increased the length and ability of neurons in the brain.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/7/7d/Australopithecusafarensis_reconstruction.jpg/492px-Australopithecusafarensis_reconstruction.jpg"},{name:"Homo habilis",description:'Homo habilis is a proposed archaic species of Homo, which lived between roughly 2.1 and 1.5 million years ago. H. habilis is intermediate between Australopithecus and the somewhat younger Homo erectus and its classification in the genus Homo has been the subject of controversial debate since its original proposal. A main argument for its classification as the first Homo ("human") species was its use of flaked stone tools. However, evidence for earlier tool use (3.39 million years ago) by undisputed members of Australopithecus has been found',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/61/Homo_habilis-2.JPG/398px-Homo_habilis-2.JPG"}]},{period:"Pleistocene",upper:"1.8 Mya",lower:".01 Mya",data:[{name:"Homo ergaster",description:"Homo ergaster , also Homo erectus ergaster or African Homo erectus is an extinct chronospecies of the genus Homo that lived in eastern and southern Africa during the early Pleistocene, between about 1.9 million and 1.4 million years ago. Originally proposed as a separate species, H. ergaster is now mostly considered either an early form, or an African variety, of H. erectus. H. ergaster used more diverse and sophisticated stone tools than its predecessor, H. habilis. ",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/7/70/Homo_ergaster.jpg/400px-Homo_ergaster.jpg"},{name:"Homo erectus",description:"Homo erectus derives from early Homo or late Australopithecus. Homo erectus meaning 'upright man'.From its earliest appearance, H. erectus (in Africa also known as Homo ergaster) is distributed in East Africa and Southwest Asia. H. erectus later migrates throughout Eurasia, and is described in a number of subspecies. H. erectus is also the first known species to develop control of fire, by about 1.5 Ma. Evolution of dark skin at about 1.2 Ma.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/a/af/Australopithecus_afarensis_new.JPG/440px-Australopithecus_afarensis_new.JPG"},{name:"Homo heidelbergensis",description:"Homo heidelbergensis is an extinct species or subspecies of archaic humans in the genus Homo, which radiated in the Middle Pleistocene from about 700,000 to 300,000 years ago, known from fossils found in Southern Africa, East Africa and Europe. The skulls of this species share features with both Homo erectus and the anatomically modern Homo sapiens; its brain was nearly as large as that of Homo sapiens.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/37/Skull%2C_Natural_History_Museum%2C_London_-_DSCF0431.JPG/360px-Skull%2C_Natural_History_Museum%2C_London_-_DSCF0431.JPG"},{name:"Earliest Fossils of Homo sapiens",description:"Fossils attributed to H. sapiens, along with stone tools, dated to approximately 300,000 years ago, found at Jebel Irhoud, Morocco yield the earliest fossil evidence for anatomically modern Homo sapiens. Modern human presence in East Africa (Gademotta), at 276 kya. A 177,000-year-old jawbone fossil discovered in Israel is the oldest human remains found outside Africa.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/c/cd/Jebel_Irhoud_1._Homo_Sapiens.jpg/640px-Jebel_Irhoud_1._Homo_Sapiens.jpg"},{name:"Neanderthal",description:'Neanderthals( Homo neanderthalensis or Homo sapiens neanderthalensis) are an extinct species or subspecies of archaic humans in the genus Homo, who lived within Eurasia from circa 400,000 until 40,000 years ago. Compared to modern humans, Neanderthals were stockier, with shorter legs and bigger bodies. There has been growing evidence for admixture between Neanderthals and anatomically modern humans, reflected in the genomes of all modern non-African populations, but not in the genomes of most sub-Saharan Africans. This suggests that interbreeding between Neanderthals and anatomically modern humans took place after the recent "out of Africa" migration, around 70,000 years ago.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e8/Neanderthalensis.jpg/423px-Neanderthalensis.jpg"},{name:"Homo sapiens idaltu",description:'Homo sapiens idaltu (Afar: Idaltu; "elder" or "first born"), also called Herto Man, is the name given to a number of early modern human fossils. The recognition of H. s. idaltu as a valid subspecies of the anatomically modern human lineage would justify the description of contemporary humans with the subspecies name H. s. sapiens. Because of their early dating and unique physical characteristics, they represent the immediate ancestors of anatomically modern humans ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9b/Homo_Sapiens_Idaltu.JPG/640px-Homo_Sapiens_Idaltu.JPG"},{name:"Peopling of Europe",description:'European early modern humans (EEMH) in the context of the Upper Paleolithic in Europe refers to the early presence of anatomically modern humans in Europe. The term "early modern" is usually taken to include fossils of the Bohunician, Ahmarian, Aurignacian, Gravettian, Solutrean and Magdalenian, extending throughout the Last Glacial Maximum (LGM), covering the period of roughly 48,000 to 15,000 years ago, usually referred to as the Cro-Magnon. ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/9/95/Cro-Magnon-male-skull.png/574px-Cro-Magnon-male-skull.png"}]},{period:"Holocene",upper:"0.01 Mya",lower:"Present",data:[{name:"Modern Humans",description:"Extinction of late surviving archaic humans at the beginning of the Holocene (12 ka). Accelerated divergence due to selection pressures in populations participating in the Neolithic Revolution after 12 ka, e.g. East Asian types of ADH1B associated with rice domestication, or lactase persistence. ",url:"https://mrebbers.weebly.com/uploads/6/9/6/3/6963302/1464058978.png"}]}]}},"7f7f":function(e,a,i){var t=i("86cc").f,o=Function.prototype,s=/^\s*function ([^ (]*)/,r="name";r in o||i("9e1e")&&t(o,r,{configurable:!0,get:function(){try{return(""+this).match(s)[1]}catch(e){return""}}})},9320:function(e,a,i){var t={"./birds.json":"37aa","./fish.json":"ab8d","./humans.json":"6983","./insects.json":"e88a","./mammals.json":"9937","./reptiles.json":"a301"};function o(e){var a=s(e);return i(a)}function s(e){var a=t[e];if(!(a+1)){var i=new Error("Cannot find module '"+e+"'");throw i.code="MODULE_NOT_FOUND",i}return a}o.keys=function(){return Object.keys(t)},o.resolve=s,e.exports=o,o.id="9320"},9937:function(e){e.exports={id:"mammal",evolution_data:[{period:"Carboniferous",upper:"359 Mya",lower:"299 Mya",data:[{name:"Amniote",description:"The first fully terrestrial vertebrates were amniotes — their eggs had internal membranes that allowed the developing embryo to breathe but kept water in.\n Within a few million years, two important amniote lineages became distinct: mammals' synapsid ancestors and the sauropsids, from which lizards, snakes, turtles/tortoises, crocodilians, dinosaurs, and birds are descended. The earliest known fossils of synapsids and sauropsids (such as Archaeothyris and Hylonomus, respectively) date from about 320 to 315 million years ago.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/36/Archaeothyris_BW.jpg/250px-Archaeothyris_BW.jpg"}]},{period:"Permian",upper:"298 Mya",lower:"252 Mya",data:[{name:"Synapsids",description:"The pelycosaurs spread and diversified, becoming the largest terrestrial animals in the latest Carboniferous and Early Permian periods, ranging up to 6 metres (20 ft) in length. They were sprawling, bulky, possibly cold-blooded, and had small brains.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/1/10/Moschops_BW.jpg/220px-Moschops_BW.jpg"},{name:"Therapsids",description:"The therapsids, a more advanced group of synapsids, appeared during the Middle Permian and included the largest terrestrial animals in the Middle and Late Permian. They included herbivores and carnivores, ranging from small animals the size of a rat (e.g.: Robertia), to large, bulky herbivores a ton or more in weight (e.g.: Moschops). After flourishing for many millions of years, these successful animals were all but wiped out by the Permian-Triassic mass extinction about 250 mya, the largest known extinction in Earth's history. \n Only a few therapsids went on to be successful in the new early Triassic landscape",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/42/Pristeroognathus_DB.jpg/220px-Pristeroognathus_DB.jpg"}]},{period:"Triassic",upper:"252 Mya",lower:"201 Mya",data:[{name:"Cynodonts",description:"The cynodonts were small, mammal-like creatures that lived in burrows. They probably laid eggs may have been warm-blooded. The cynodonts were the only mammal-like reptiles to survive to the Jurassic, in fact they nearly made it into the Cretaceous, and definitely coexisted with many of the major dinosaurs.",url:"http://1.bp.blogspot.com/-3HvnHzuMxwI/VAZf9guxRYI/AAAAAAAADGk/o3lTYVD7StQ/s1600/800px-Dicynodont_from_PolandDB.jpg"}]},{period:"Jurassic",upper:"201 Mya",lower:"145 Mya",data:[{name:"Tritylodon",description:"Tritylodon (Greek for 3 cusped tooth) is an extinct genus of tritylodonts, one of the most advanced group of cynodont therapsids. They lived in the Early Jurassic and possibly Late Triassic periods along with dinosaurs. They also shared a lot of characteristics with mammals, and were once considered mammals because of overall skeleton construction. That was changed due to them retaining the vestigial reptilian jawbones and a different skull structure. Tritylodons are now regarded as non-mammalian synapsids.",url:"https://upload.wikimedia.org/wikipedia/commons/c/cb/Tritylodon_BW.jpg"},{name:"mammal",description:'Late Triassic vertebrates like Eozostrodon, Megazostrodon and Sinoconodon appear to have been intermediate "missing links" between therapsids and mammals, and even in the early Jurassic period, Oligokyphus possessed reptilian ear and jaw bones at the same time as it showed every other sign (rat-like teeth, the habit of suckling its young) of being a mammal.',url:"http://upload.wikimedia.org/wikipedia/commons/thumb/3/39/Oligokyphus_BW.jpg/500px-Oligokyphus_BW.jpg"}]},{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:"mammal",description:"By the middle of the Cretaceous period, about 100 million years ago,three different kinds of mammals had appeared - Monotremes, Marsupials, Placental mammals.After the Cretaceous period, mammals took over many of the ecological roles that dinosaurs previously had.",url:"https://i.pinimg.com/originals/77/74/cc/7774cc80e7e69e2ed2f147871d9b6450.png"},{name:"Monotremes",description:" Monotremes are oviparous, meaning that they lay eggs",url:"https://ih0.redbubble.net/image.57057848.6730/raf,750x1000,075,t,e0e1dd:064437a66d.jpg"},{name:"Marsupials",description:"Marsupials are viviparous, meaning that they give birth to live young. In marsupials, the young develop within a pouch on the mother’s body for some time after birth.",url:"https://i.stack.imgur.com/D2nkZ.jpg"},{name:"Placental mammals",description:"Placental mammals are also viviparous, but in this group, the fetus typically develops within the mother’s reproductive system for a longer time and receives nourishment through a blood-rich structure called the placenta.",url:"http://www.desertbruchid.net/4_GB_Lecture_figs_f/4_GB_24_AnimaliaVert_Fig_f/Mammals_Placentals.jpg"}]},{period:"Cenozoic",upper:"66 Mya",lower:"present",data:[{name:"Monotremes",description:"The order Monotremata the monotremes, is the only order in the subclass Prototheria. Monotremes probably evolved before other kinds of mammals. Just three species exist today: \n The duckbill platypus is adapted to life around rivers or streams in Australia. \n Two echidna species live in dry woodlands or deserts in Australia and New Guinea.",url:"https://ih0.redbubble.net/image.57057848.6730/raf,750x1000,075,t,e0e1dd:064437a66d.jpg"},{name:"Marsupials",description:"The marsupials had previously been classified in one order, Marsupialia, but are now divided into at least seven orders within the super order Marsupialia. The majority of about 280 species of marsupials live in Australia, but some live in New Guinea and the Americas. The Virginia opossum is the only marsupial native to the United States. Scientists think that marsupials began to evolve in isolation when Australia and New Guinea drifted away from the other continents more than 40 million years ago. ",url:"https://i.stack.imgur.com/D2nkZ.jpg"},{name:["Anatalavis","ducks","geese"],description:"Anatalavis is genus of prehistoric birds related to ducks and geese, perhaps in particular the magpie-goose. The species Anatalavis rex – formerly placed in Telmatornis – is known from the Hornerstown Formation (Late Cretaceous or Early Paleocene, some 66 million years ago) of New Jersey.",url:"https://upload.wikimedia.org/wikipedia/commons/0/03/Magpie_Goose_taking_off.jpg"},{name:"Placental Mammals",description:"Nearly 95 percent of all mammalian species are placental mammals, making up the infraclass Eutheria of the subclass Theria. ",url:"http://www.desertbruchid.net/4_GB_Lecture_figs_f/4_GB_24_AnimaliaVert_Fig_f/Mammals_Placentals.jpg"},{name:["Xenarthra","armadillo","sloths"],description:'It currently consists of anteaters, tree sloths, and armadillos. Xenarthrans originated in South America during the Paleocene about 59 million years ago. They evolved and diversified extensively in South America during the continent\'s long period of isolation in the early to mid Cenozoic Era. The name Xenarthra, which means "strange joints", was chosen because their vertebral joints have extra articulations unlike other mammals. ',url:"https://upload.wikimedia.org/wikipedia/commons/7/71/Choloepus_hoffmanni_%28Puerto_Viejo%2C_CR%29_crop.jpg"},{name:["Lagomorpha","hares","rabbits","pikas"],description:"The lagomorphs are the members of the taxonomic order Lagomorpha, of which there are two living families: the Leporidae (hares and rabbits) and the Ochotonidae (pikas). Although lagomorphs are more closely related to rodents than any other mammals, the two orders still have some major differences. Lagomorphs differ from rodents in that the former have four incisors in the upper jaw (not two, as in the Rodentia). Also, lagomorphs are almost strictly herbivorous, unlike rodents, many of which will eat both meat and vegetable matter",url:"https://upload.wikimedia.org/wikipedia/commons/3/37/Oryctolagus_cuniculus_Tasmania_2.jpg"},{name:["Rodentia","rodents","rats","mice","squirrrels","chipmunks","beavers"],description:'Rodents (from Latin Rodere, "to gnaw") are mammals of the order Rodentia, which are characterized by a single pair of continuously growing incisors in each of the upper and lower jaws. About 40% of all mammal species are rodents (2,277 species); they are found in vast numbers on all continents except Antarctica. They are the most diversified mammalian order and live in a variety of terrestrial habitats, including human-made environments. \n Species can be arboreal, fossorial (burrowing), or semiaquatic. Well-known rodents include mice, rats, squirrels, prairie dogs, chipmunks, chinchillas porcupines, beavers, guinea pigs, hamsters, gerbils and capybaras. ',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/40/Rodent_collage.jpg/290px-Rodent_collage.jpg"},{name:["Primates","baboon","great apes","capuchin","howler","squirrel monkey"],description:"A primate is a eutherian mammal constituting the taxonomic order Primates. Primates arose 85–55 million years ago from small terrestrial mammals (Primatomorpha), which adapted to living in the trees of tropical forests: many primate characteristics represent adaptations to life in this challenging environment, including large brains, visual acuity, color vision, altered shoulder girdle, and dexterous hands. \n Common names for the simians are the (Old World) baboons, macaques, gibbons, and great apes; and the (New World) capuchins, howlers and squirrel monkeys.",url:"https://static01.nyt.com/images/2017/01/19/science/19MATTER/19MATTER-jumbo.jpg"},{name:["Chiroptera","bats"],description:"Chiropetra, the bats , are the only mammals that truly fly. More than 900 species live throughout the world, except in polar environments.",url:"https://sites.google.com/a/pleasantonusd.net/order-chiroptera/_/rsrc/1492389497946/home/imgres.jpg?height=307&width=400"},{name:["Insectivora","shrews","hedgehogs","moles"],description:"The order Insectivora includes about 390 species of shrews, hedgehogs, and moles. Most members of this order are insectivores, but not all insectivores are members of the order Insectivora.",url:"https://www.thoughtco.com/thmb/rIkoO5Fbg05LxaKt2VyD4SqMx9I=/768x0/filters:no_upscale():max_bytes(150000):strip_icc()/2080092-56a006bc3df78cafda9fb1c0.jpg"},{name:["Carnivora","carnivores","cat","dog"],description:'Carnivora includes over 280 species of placental mammals."Carnivore" can refer to any meat-eating organism. Carnivorans are the most diverse in size of any mammalian order, ranging from the least weasel (Mustela nivalis) to the polar bear, to the southern elephant seal. \n Carnivorans have teeth and claws adapted for catching and eating other animals. Many hunt in packs and are social animals, giving them an advantage over larger prey. Some carnivorans, such as cats and pinnipeds, depend entirely on meat for their nutrition. Others, such as raccoons and bears, are more omnivorous, depending on the habitat. The giant panda is largely a herbivore, but also feeds on fish, eggs and insects. The polar bear subsists mainly on seals. \n Carnivorans are split into two suborders: Feliformia ("catlike") and Caniformia ("doglike").',url:"https://www.exploringnature.org/graphics/posters/carnivores_poster72.jpg"},{name:["Artiodactyla","pigs","sheep","deer","goat","cattle","camels","giraffes","llamas"],description:"The even-toed ungulates (Artiodactyla, from Ancient Greek ἄρτιος (ártios), meaning 'even', and δάκτυλος (dáktylos), meaning 'finger/toe') are ungulates - hoofed animals - which bear weight equally on two (an even number) of the five toes: their third and fourth toes. The other three toes are either present, absent, vestigial, or pointing posteriorly. \nThe roughly 220 land-based even-toed ungulate species include pigs, peccaries, hippopotamuses, camels, llamas, alpacas, mouse deer, deer, giraffes, antelopes, sheep, goats, and cattle. Many of these are of great dietary, economic, and cultural importance to humans.",url:"https://upload.wikimedia.org/wikipedia/commons/1/1f/The_Artiodactyla.jpg"},{name:["Perissodactyla","horses","zebra","asses","rhinoceroses"],description:'Odd-toed ungulates, mammals which constitute the taxonomic order Perissodactyla (from the Ancient Greek περισσός perissós, "uneven"; and δάκτυλος dáktylos, "finger, toe"), are hoofed animals—ungulates—which bear most of their weight on one (an odd number) of the five toes: the third toe. The non-weight-bearing toes are either present, absent, vestigial, or positioned posteriorly. The order includes about 17 species divided into three families: Equidae (horses, asses, and zebras), Rhinocerotidae (rhinoceroses), and Tapiridae (tapirs).',url:"https://upload.wikimedia.org/wikipedia/commons/3/3f/The_Perissodactyl.jpg"},{name:["Cetacea","porpoise","dolphins","beaked whale","whale"],description:"Cetaceans are aquatic mammals constituting the infraorder Cetacea. There are around 89 living species, which are divided into two parvorders. The first is the Odontoceti, the toothed whales, which consist of around 70 species, including the dolphin (which includes killer whales), porpoise, beluga whale, narwhal, sperm whale, and beaked whale. The second is the Mysticeti, the baleen (from Latin: balæna, lit. 'whale') whales, which have a filter-feeder system, and consist of 15 species divided into 3 families, and include the right whale, bowhead whale, rorqual, pygmy right whale, and gray whale.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/2b/The_Cetacea.jpg/310px-The_Cetacea.jpg"},{name:["Sirenia","sea cows","dugong","manatees"],description:"The Sirenia, commonly referred to as sea cows or sirenians, are an order of fully aquatic, herbivorous mammals that inhabit swamps, rivers, estuaries, marine wetlands, and coastal marine waters. The Sirenia currently comprise the families Dugongidae (the dugong) and Trichechidae (manatees) with a total of four species. The Protosirenidae (Eocene sirenians) and Prorastomidae (terrestrial sirenians) families are extinct. Sirenians are classified in the clade Paenungulata, alongside the elephants and the hyraxes, and evolved in the Eocene 50 million years ago. The Dugongidae diverged from the Trichechidae in the late Eocene or early Oligocene.",url:"https://i.ytimg.com/vi/BMu7A7PCFsE/maxresdefault.jpg"},{name:["Probscidea","elephant"],description:"The Proboscidea are a taxonomic order of afrotherian mammals containing one living family (Elephantidae) and several extinct families. In addition to their enormous size, later proboscideans are distinguished by tusks and long, muscular trunks; these features were less developed or absent in the smaller early proboscideans. Beginning in the mid Miocene, most members of this order were very large animals. The largest land mammal today is the African elephant weighing up to 10.4 tonnes with a shoulder height of up to 4 metres (13.1 ft).",url:"https://upload.wikimedia.org/wikipedia/commons/5/5d/AfricanElephant.jpg"},{name:["Macroscelidea","elephant shrew"],description:'Elephant shrews, also called jumping shrews or sengis, are small insectivorous mammals native to Africa, belonging to the family Macroscelididae, in the order Macroscelidea. Their traditional common English name "elephant shrew" comes from a perceived resemblance between their long noses and the trunk of an elephant, and their superficial similarity with shrews (family Soricidae) in the order Eulipotyphla. Elephant shrews, also called jumping shrews or sengis, are small insectivorous mammals native to Africa, belonging to the family Macroscelididae, in the order Macroscelidea. Their traditional common English name "elephant shrew" comes from a perceived resemblance between their long noses and the trunk of an elephant, and their superficial similarity with shrews (family Soricidae) in the order Eulipotyphla.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/8/81/Rhynchocyon_petersi_from_side.jpg/1200px-Rhynchocyon_petersi_from_side.jpg"},{name:["Pholidota","scaly anteaters","pangolins"],description:'Pangolins or scaly anteaters are mammals of the order Pholidota (from the Greek word φολῐ́ς, "horny scale"). The one extant family, Manidae, has three genera: Manis, which comprises four species living in Asia; Phataginus, which comprises two species living in Africa; and Smutsia, which comprises two species also living in Africa. These species range in size from 30 to 100 cm (12 to 39 in). A number of extinct pangolin species are also known. \n Pangolins have large, protective keratin scales covering their skin; they are the only known mammals with this feature. They live in hollow trees or burrows, depending on the species. Pangolins are nocturnal, and their diet consists of mainly ants and termites, which they capture using their long tongues. They tend to be solitary animals, meeting only to mate and produce a litter of one to three offspring, which are raised for about two years.',url:"https://ucmp.berkeley.edu/mammal/eutheria/pangolin2.gif"},{name:["Tubulidentata","Aardvark"],description:"Orycteropodidae is a family of afrotherian mammals. Although there are many fossil species, the only species surviving today is the aardvark, Orycteropus afer. Orycteropodidae is recognized as the only family within the order Tubulidentata, so the two are effectively synonyms. \n Aardvarks had originally been categorized as relatives of American anteaters in the order Edentata. But their unique type of teeth and other morphological characteristics had made it clear that aardvarks are not closely related to any other living mammals. Since the end of the 19th century, they are placed in their own separate order Tubulidentata. Both the fossil record and genetic studies have corroborated that separate status. All similarities to American anteaters have evolved independently as adaptations to eating ants. \n Orycteropodidae members are polygynous, the females providing care for the young. They are territorial, and only cross paths to breed.",url:"https://upload.wikimedia.org/wikipedia/commons/8/8a/Porc_formiguer.JPG"},{name:["Scandentia","tree shrew"],description:"The treeshrews (or tree shrews or banxrings) are small Euarchontoglire mammals native to the tropical forests of Southeast Asia. They make up the families Tupaiidae, the treeshrews, and Ptilocercidae, the pen-tailed treeshrew, and the entire order Scandentia. The 20 species are placed in five genera. Treeshrews have a higher brain to body mass ratio than any other mammal, including humans, but high ratios are not uncommon for animals weighing less than a kilogram. \n Though called 'treeshrews', and despite having previously been classified in Insectivora, they are not true shrews, and not all species live in trees. Among other things, treeshrews eat Rafflesia fruit. \n Among orders of mammals, treeshrews are closely related to primates, and have been used as an alternative to primates in experimental studies of myopia, psychosocial stress, and hepatitis.",url:"https://upload.wikimedia.org/wikipedia/commons/7/78/Anathana_ellioti.jpg"},{name:["Dermoptera","colugo"],description:"Colugos are arboreal gliding mammals found in Southeast Asia, and the closest relative of the primates. Just two extant species make up the entire family Cynocephalidae and order Dermoptera. They are the most capable gliders of all gliding mammals, using flaps of extra skin between their legs to glide from higher to lower locations. They are also known as cobegos or flying lemurs, but they are not true lemurs, simply close relatives.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/c/cd/Colugo_%28Galeopterus_variegatus%2C_adult_female%29%2C_Central_Catchment_Area%2C_Singapore_-_20060618.jpg/220px-Colugo_%28Galeopterus_variegatus%2C_adult_female%29%2C_Central_Catchment_Area%2C_Singapore_-_20060618.jpg"},{name:["Hyracoidea","hyraxes","dassies"],description:"Hyraxes, also called dassies,are small, thickset, herbivorous mammals in the order Hyracoidea. Hyraxes are well-furred, rotund animals with short tails. Five extant species are recognised; the rock hyrax (Procavia capensis) and the yellow-spotted rock hyrax (Heterohyrax brucei), which both live in isolated rock outcrops, called kopjes, the western tree hyrax (Dendrohyrax dorsalis), southern tree hyrax (D. arboreus), and eastern tree hyrax (D. validus).",url:"https://ucmp.berkeley.edu/mammal/mesaxonia/hyrax.jpg"}]}]}},a301:function(e){e.exports={id:"reptile",evolution_data:[{period:"Carboniferous",upper:"359 Mya",lower:"299 Mya",data:[{name:"Casineria",description:"The origin of the reptiles lies about 320–310 million years ago, in the swamps of the late Carboniferous period, when the first reptiles evolved from advanced reptiliomorph labyrinthodonts. The oldest known animal that may have been an amniote, a reptile rather than an amphibian, is Casineria (though it has also been argued to be a temnospondyl amphibian).\n Casineria was a small animal with a postcrania length estimated to have been 15 centimeters. Its small size would have made it ideal for hunting the invertebrates of the Carboniferous. \n In the early Carboniferous period before the appearance of Casineria, vertebrates were primarily aquatic, only spending part of their time on land. Casineria and its relatives were the first vertebrates to live and reproduce on land. ",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/4e/Casineria_kiddi_reconstruction.jpg/170px-Casineria_kiddi_reconstruction.jpg"},{name:"Hylonomus",description:"A series of footprints from the fossil strata of Nova Scotia, dated to 315 million years, show typical reptilian toes and imprints of scales. The tracks are attributed to Hylonomus, the oldest unquestionable reptile known. It was a small, lizard-like animal, about 20 to 30 cm (8–12 in) long, with numer ous sharp teeth indicating an insectivorous diet.",url:"https://upload.wikimedia.org/wikipedia/commons/5/50/Hylonomus_lyelli_-_MUSE.jpg"},{name:"Westlothiana lizziae",description:'Westlothiana ("animal from West Lothian") is a genus of reptile-like tetrapod that lived about 338 million years ago during the latest part of the Visean age of the Carboniferous. Members of the genus bore a superficial resemblance to modern-day lizards. However, despite its similar body shape, Westlothiana is not considered a true lizard. ',url:"https://www.nms.ac.uk/media/1150829/lizzie-model-john-holmes.jpg?width=700&height=385.9706362153344"},{name:"Cochleosaurus",description:"Cochleosaurus ('spoon lizard') is a name of a tetrapod belonging to Temnospondyli, which lived during the late Carboniferous period (Moscovian, about 310 millions years ago). It was a creature of medium size, measuring 120-160 centimeters. It is believed that Cochleosaurus was a semiaquatic ambush predator, hunting like modern crocodiles. ",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Cochleosaurus.jpg/439px-Cochleosaurus.jpg"}]},{period:"Permian",upper:"298 Mya",lower:"252 Mya",data:[{name:"Edaphosaurus",description:"Edaphosaurus is a genus of extinct edaphosaurid synapsid that lived in what is now North America and Europe around 300 to 280 million years ago, during the late Carboniferous to early Permian periods.\n Edaphosaurus is important as one of the earliest known large plant-eating (herbivorous) amniote tetrapods (four-legged land-living vertebrates).",url:"https://www.newdinosaurs.com/wp-content/uploads/2016/11/1315_edaphosaurus_nobu_tamura.jpg"},{name:["Pareiasaur","Cheek lizard"],description:'Pareiasaurs (meaning "cheek lizards") were a clade of parareptiles comprising the family Pareiasauridae. They were large herbivores that flourished during the Permian period. Parareptiles form a sister clade to reptiles and birds.\n The pareiasaurs reached giant proportions in the late Permian, eventually disappearing at the close of the period.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/68/Bradysaurus_BW.jpg/200px-Bradysaurus_BW.jpg"},{name:["Archosaurus","Crocodile","birds"],description:"Archosaurs are a group of diapsid amniotes whose living representatives consist of birds and crocodilians. This group also includes all extinct dinosaurs, extinct crocodilian relatives, and pterosaurs. \n Permian reptiles Archosaurus rossicus and/or Protorosaurus speneri as true archosaurs maintain that archosaurs first appeared in the late Permian. They remained lizard-like and relatively small and inconspicuous during the Permian.",url:"https://vignette.wikia.nocookie.net/dinosaurs/images/0/05/Archosaurus.jpg/revision/latest/scale-to-width-down/400?cb=20140210132002"},{name:["Lepidosaur","scaled lizards","snakes","tuataras"],description:" lepidosaurs are the predecessors of modern tuataras, lizards, and snakes. They remained lizard-like and relatively small and inconspicuous during the Permian.",url:"https://classconnection.s3.amazonaws.com/623/flashcards/4089623/jpg/tuatara-141F2C57E5272764906-thumb400.jpg"}]},{period:"Triassic",upper:"252 Mya",lower:"201 Mya",data:[{name:"dinosaurs",description:'During the first half of the Triassic, however, dinosaurs were still a long way from ruling the Earth. They had a variety of competitors, including close relatives from the same animal group that dinosaurs themselves belonged to, the archosaurs ("ruling reptiles"). Crocodile-like terrestrial predators were among the most successful of these archosaur rivals but they had died out by the end of the Triassic.',url:"https://fbcd.co/product-lg/26a19e84096dd5af13eaa7f1077c250f_resize.jpg"},{name:["coelophysis","dinosaurs"],description:'One of the first true dinosaurs was coelophysis ("hollow form"), a carnivorous, bipedal predator that emerged in the late Triassic, between 225 and 220 MYA. Hollow-boned coelophysis grew up to 3 metres in length, weighed around 27kg and probably fed on smaller reptiles and amphibians. It had curved claws on its hands and a slim head crammed full of very sharp teeth.',url:"https://www.newdinosaurs.com/wp-content/uploads/2016/01/206_coelophysis_camus_altamirano.jpg"},{name:["Plateosaurus","dinosaurs"],description:'Around 210 MYA, a new type of dinosaur emerged - the giant herbivore, plateosaurus ("flat lizard"). Weighing around 3 tonnes and growing up to 7 metres, plateosarus was a forerunner of the huge Jurassic dinosaurs. It had a long, powerful tail and a set of coarsely serrated teeth for chewing tough vegetation. plateosaurus also had a large, curved claw on its thumb. ',url:"https://www.everythingdinosaur.com/wp-content/uploads/2016/10/CollectA_Plateosaurus_dinosaur_model.jpg"},{name:["Cynodonts","mammals"],description:"The cynodonts were small, mammal-like creatures that lived in burrows. They probably laid eggs may have been warm-blooded.",url:"http://www.worldsofimagination.co.uk/Thrinaxodon_BW.jpg"}]},{period:"Jurassic",upper:"201 Mya",lower:"145 Mya",data:[{name:["Sauropods","dinosaurs"],description:'Sauropods first appeared in the late Triassic Period, where they somewhat resembled the closely related (and possibly ancestral) group "Prosauropoda". By the Late Jurassic (150 million years ago), sauropods had become widespread (especially the diplodocids and brachiosaurids). They had very long necks, long tails, small heads (relative to the rest of their body), and four thick, pillar-like legs. They are notable for the enormous sizes attained by some species, and the group includes the largest animals to have ever lived on land. Well-known genera include Brachiosaurus, Diplodocus, Apatosaurus and Brontosaurus.',url:"https://vignette.wikia.nocookie.net/dinosaurs/images/5/55/Sauropodomorpha.png/revision/latest?cb=20140811153247"},{name:["pterosaurs"],description:"Pterosaurs first appeared in the late Triassic Period and roamed the skies until the end of the Cretaceous Period (228 to 66 million years ago). Pterodactyl is the common term for the winged reptiles properly called pterosaurs. Pterosaurs lived among the dinosaurs and became extinct around the same time, but they were not dinosaurs. Rather, pterosaurs were flying reptiles.Modern birds didn't descend from pterosaurs.",url:"https://cdn.shopify.com/s/files/1/2281/5369/products/100486_1_x700.jpg?v=1548935129"},{name:["allosaurus","dinosaurs"],description:" Allosaurus was one of the most common Carnosaurs in North America; numerous intact skeletons have been found in the fossil beds of Utah. Allosaurus was superficially similar to the later evolving Tyrannosaurus rex, although cladistic analysis shows them to be only distantly related. Allosaurus was a bit smaller with a longer jaw and heavier forelimbs. They relied on the stronger hind limbs for a running gait, but it is unclear how fast they could move.",url:"https://img.purch.com/w/660/aHR0cDovL3d3dy5saXZlc2NpZW5jZS5jb20vaW1hZ2VzL2kvMDAwLzAzMy80MzUvb3JpZ2luYWwvc2h1dHRlcnN0b2NrXzI3MzIzNzk3LmpwZw=="},{name:["Ichthyosaurus","dinosaurs"],description:"Ichthyosaurus was a more fish-shaped reptile that was most common in the early Jurassic.",url:"https://www.newdinosaurs.com/wp-content/uploads/2016/11/1483_ichthyosaurus_felipe_arias.jpg"},{name:["Archaeopteryx","bird","dinosaur"],description:' Archaeopteryx was the "original bird" or "first bird".  They were bird-like dinosaurs that is transitional between non-avian feathered dinosaurs and modern birds. Archaeopteryx lived in the Late Jurassic around 150 million years ago. \n Despite their small size, broad wings, and inferred ability to fly or glide, Archaeopteryx had more in common with other small Mesozoic dinosaurs than with modern birds. In particular, they shared the following features with the dromaeosaurids and troodontids: jaws with sharp teeth, three fingers with claws, a long bony tail, hyperextensible second toes ("killing claw"), feathers (which also suggest warm-bloodedness), and various features of the skeleton. ',url:"http://www.dinosaurusi.com/video_slike/Cosv3BjCl5-Dinosaurus_-_Dinosaur_-_Dinosaurio_-_Dinosaure_-_Archeopteryx005.jpg"}]},{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:["Tyrannosaurus Rex","dinosaurs"],description:"The \"tyrant lizard king\" was a terrifying predator who evolved during the late Cretaceous and grew to 12 metres in length. It weighed around 5 tonnes and could open its massive jaws an eye-watering 1 metre wide. \nTheir strong banana-length teeth, weren't just capable of ripping flesh. They could crunch through bone, too. However, T. rex wasn't all brute force. It had acute, binocular eyesight, sensitive hearing and a highly developed sense of smell. The dinosaurs came to an end by the end of the Cretaceous period.",url:"https://cdn.newsapi.com.au/image/v1/c32e77ada066e25b416c4c515f35049f?width=650"},{name:["Velociraptor","dinosaurs"],description:' Velociraptors ("quick plunderer") were very much a lightweight at just 1.8 metres in length and weighing between 7kg and 15kg. It is also a universal belief that they would have been covered in feathers.  The dinosaurs came to an end by the end of the Cretaceous period.',url:"https://upload.wikimedia.org/wikipedia/commons/5/55/Velociraptor_Restoration.png"},{name:["Triceratops","dinosaurs"],description:"Triceratop grew to around 9 metres in length and weighed up to 10 tonnes. As well as three deadly horns, Triceratops had an impressive bony frill behind its head. Triceratops was a herbivore, using it's beak to gather tough vegetation. The dinosaurs came to an end by the end of the Cretaceous period",url:"http://images.dinosaurpictures.org/triceratops-roger-hall-and-photo-researchers_1b1e.jpg"},{name:["birds","dinosaurs"],description:"Birds had evolved from the theropod group of dinosaurs, which included bipedal predators such as Velociraptor and T. rex. By the late Cretaceous, birds were widespread in forests and mudflats. Some resembled modern birds, such as curlews and sandpipers. There was even a forerunner of today's parrot family. Birds were not affected by the mass extinction by the end of the Cretaceous period.",url:"https://vignette.wikia.nocookie.net/dinosaurs/images/4/41/TheropodaInfobox.png/revision/latest?cb=20151103002314"}]},{period:"Cenozoic",upper:"66 Mya",lower:"present",data:[{name:"reptiles",description:"Smaller reptiles that survived the Cretaceous, such as turtles, snakes, crocodiles, and lizards, basked in the tropical warmth along the coasts. Birds, the holdouts of the dinosaur age, diversified and flourished in the skies. But the rapidly evolving mammals stole the show. ",url:"http://www.animalsworlds.com/images/reptiles.png"},{name:"Megalodon",description:"Megalodon is an extinct species of shark that lived about 28 to 1.5 Ma. It looked much like a stocky version of the great white shark, but was much larger with fossil lengths reaching 20.3 metres (67 ft). Found in all oceans, it was one of the largest and most powerful predators in vertebrate history, and probably had a profound impact on marine life.",url:"https://www.moas.org/zupload/library/547/-761-2048x1070-0.jpg?ztv=20181018114208"}]}]}},ab8d:function(e){e.exports={id:"fish",evolution_data:[{period:"Cambrian",upper:"541 Mya",lower:"485 Mya",data:[{name:"Pikaia",description:"Pikaia, along with Myllokunmingia and Haikouichthys ercaicunensis immediately below, are all candidates in the fossil record for the titles of first vertebrate and first fish. Pikaia is a genus that appeared about 530 Ma during the Cambrian explosion of multicellular life. Pikaia gracilens (pictured) is a transitional fossil between invertebrates and vertebrates, and may be the earliest known chordate. In this sense it may have been the original ancestor of fishes. It was a primitive creature with no evidence of eyes, without a well defined head, and less than 2 inches (5 centimetres) long. Pikaia was a sideways-flattened, leaf-shaped animal that swam by throwing its body into a series of S-shaped, zig-zag curves, similar to movement of snakes. Fish inherited the same swimming movement, but they generally have stiffer backbones. It had a pair of large head tentacles and a series of short appendages, which may be linked to gill slits, on either side of its head. Pikaia shows the essential prerequisites for vertebrates. The flattened body is divided into pairs of segmented muscle blocks, seen as faint vertical lines. The muscles lie on either side of a flexible structure resembling a rod that runs from the tip of the head to the tip of the tail.",url:"https://i.pinimg.com/originals/5a/b9/81/5ab981d9e24f007cd0643357161da684.jpg"},{name:"Haikouichthys",description:"Haikouichthys (fish from Haikou) is another genus that also appears in the fossil record about 530 Ma, and also marks the transition from invertebrate to vertebrates. Haikouichthys are craniates (animals with backbones and distinct heads). Unlike Pikaia, they had eyes. They also had a defined skull and other characteristics that have led paleontologists to label it a true craniate, and even to be popularly characterized as one of the earliest fishes. Cladistic analysis indicates that the animal is probably a basal chordate or a basal craniate; but it does not possess sufficient features to be included uncontroversially even in either stem group.",url:"https://upload.wikimedia.org/wikipedia/commons/5/5b/Haikouichthys_NT.jpg"},{name:"Myllokunmingia",description:"Myllokunmingia is a genus that appeared about 530 Ma. It is a chordate, and it has been argued that it is a vertebrate, It is 28 mm long and 6 mm high, and is among the oldest possible craniates.",url:"https://vignette.wikia.nocookie.net/dinosaurs/images/6/63/Myllokunmingia-small.jpg/revision/latest?cb=20130625184852"},{name:"Concodont",description:"Conodonts (cone-teeth) resembled primitive eels. They appeared 495 Ma and were wiped out 200 Ma.[24] Initially they were known only from tooth-like microfossils called conodont elements. These teeth have been variously interpreted as filter-feeding apparatuses or as a grasping and crushing array.[25] Conodonts ranged in length from a centimeter to the 40 cm Promissum. Their large eyes had a lateral position of which makes a predatory role unlikely. The preserved musculature hints that some conodonts (Promissum at least) were efficient cruisers but incapable of bursts of speed. In 2012 researchers classify the conodonts in the phylum Chordata on the basis of their fins with fin rays, chevron-shaped muscles and notochord. Some researchers see them as vertebrates similar in appearance to modern hagfish and lampreys, though phylogenetic analysis suggests that they are more derived than either of these groups.",url:"https://upload.wikimedia.org/wikipedia/commons/3/33/Euconodonta.gif"},{name:"Ostracoderms",description:"Ostracoderms (shell-skinned) are any of several groups of extinct, primitive, jawless fishes that were covered in an armour of bony plates. They appeared in the Cambrian, about 510 million years ago, and became extinct towards the end of the Devonian, about 377 million years ago. Initially Ostracoderms had poorly formed fins, and paired fins, or limbs, first evolved within this group. They were covered with a bony armour or scales and were often less than 30 cm (0.98 ft) long.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6e/Osteostraci_Janvier.gif/220px-Osteostraci_Janvier.gif"}]},{period:"Ordovician",upper:"485 Mya",lower:"443 Mya",data:[{name:"Arandaspis",description:"Arandaspis are jawless fish that lived in the early Ordovician period, about 480–470 Ma. It was about 15 cm (6 in) long, with a streamlined body covered in rows of knobbly armoured scutes. The front of the body and the head were protected by hard plates with openings for the eyes, nostrils and gills. Although it was jawless, Arandaspis might have had some moveable plates in its mouth, serving as lips, sucking in food particles. The low position of its mouth suggests it foraged the ocean floor. It lacked fins and its only method of propulsion was its horizontally flattened tail. As a result, it probably swam in a fashion similar to a modern tadpole.",url:"https://upload.wikimedia.org/wikipedia/commons/5/58/Arandaspis_NT.jpg"},{name:"Astraspis",description:"Astraspis (star shield) is an extinct genus of primitive jawless fish related to other Ordovician fishes, such as Sacabambaspis and Arandaspis. Fossils show clear evidence of a sensory structure (lateral line system). The arrangement of these organs in regular lines allows the fish to detect the direction and distance from which a disturbance in the water is coming. Arandaspis are thought to have had a mobile tail covered with small protective plates and a head region covered with larger plates. A specimen described by Sansom et al. had relatively large, lateral eyes and a series of eight gill openings on each side.",url:"https://vignette.wikia.nocookie.net/dinosaurs/images/c/c6/Astraspis_by_ntamura-d7fbwct.jpg/revision/latest?cb=20151211010226"},{name:"Pteraspidomorphi",description:"Pteraspidomorphi is an extinct class of early jawless fish. The fossils show extensive shielding of the head. Many had hypocercal tails to generate lift to increase ease of movement through the water for their armoured bodies, which were covered in dermal bone. They also had sucking mouth parts and some species may have lived in fresh water.",url:"https://upload.wikimedia.org/wikipedia/commons/7/75/Larnovaspis_stensioei.jpg"},{name:"Thelodonts",description:'Thelodonts (nipple teeth) are a class of small, extinct jawless fishes with distinctive scales instead of large plates of armour. There is debate over whether these represent a monophyletic grouping, or disparate stem groups to the major lines of jawless and jawed fish. Thelodonts are united by their characteristic "thelodont scales". This defining character is not necessarily a result of shared ancestry, as it may have been evolved independently by different groups. Thus the thelodonts are generally thought to represent a polyphyletic group.If they are monophyletic, there is no firm evidence on what their ancestral state was. These scales were easily dispersed after death; their small size and resilience makes them the most common vertebrate fossil of their time. The fish lived in both freshwater and marine environments, first appearing during the Ordovician, and perishing during the Frasnian–Famennian extinction event of the Late Devonian. They were predominantly deposit-feeding bottom dwellers, although some species may have been pelagic.',url:"https://upload.wikimedia.org/wikipedia/commons/a/ac/Thelodonti.gif"}]},{period:"Silurian",upper:"443 Mya",lower:"419 Mya",data:[{name:"Anaspida",description:"Anaspida (without shield) is an extinct class of primitive jawless vertebrates that lived during the Silurian and Devonian periods. They are classically regarded as the ancestors of lampreys. Anaspids were small, primarily marine agnathans that lacked heavy bony shield and paired fins, but have highly exaggerated hypocercal tails. They first appeared in the early Silurian, and flourished until the Late Devonian extinction, where most species, save for lampreys, became extinct. Unusually for an agnathan, anaspids did not possess a bony shield or armour. The head is instead covered in an array of smaller, weakly mineralised scales.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1a/Lasanius_NT_small.jpg/220px-Lasanius_NT_small.jpg"},{name:"Osteostraci",description:'Osteostraci ("bony shields") was a class of bony-armored jawless fish that lived from the Middle Silurian to Late Devonian. Anatomically speaking, the osteostracans, especially the Devonian species, were among the most advanced of all known agnathans. This is due to the development of paired fins, and their complicated cranial anatomy. The osteostracans were more similar to lampreys than to jawed vertebrates in possessing two pairs of semicircular canals in the inner ear, as opposed to the three pairs found in the inner ears of jawed vertebrates. Most osteostracans had a massive cephalothorac shield, but all Middle and Late Devonian species appear to have had a reduced, thinner, and often micromeric dermal skeleton. They were probably relatively good swimmers, possessing dorsal fins, paired pectoral fins, and a strong tail.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/Cephalaspis_species.jpg/220px-Cephalaspis_species.jpg"},{name:"Spiny sharks",description:'Spiny sharks, more formally called "Acanthodians" (having spines), constitute the class Acanthodii. They first appeared by the late Silurian ~420 Ma, and were among the first fishes to evolve jaws. They share features with both cartilaginous fish and bony fish, but they are not true sharks, though leading to them. They became extinct before the end of the Permian ~250 Ma. However, scales and teeth attributed to this group, as well as more derived jawed fish, such as cartilaginous and bony fish, date from the Ordovician ~460 Ma. Acanthodians were generally small shark-like fishes varying from toothless filter-feeders to toothed predators. They were once often classified as an order of the class Placodermi, but recent authorities tend to place the acanthodians as a paraphyletic assemblage leading to modern cartilaginous fish. They are distinguished in two respects: they were the earliest known jawed vertebrates, and they had stout spines supporting all their fins, fixed in place and non-movable (like a shark\'s dorsal fin), an important defensive adaptation. Their fossils are extremely rare.',url:"https://upload.wikimedia.org/wikipedia/commons/7/7e/Acanthodes_BW.jpg"},{name:"Placoderms",description:"Placoderms, (plate-like skin), are a group of armoured jawed fishes, of the class Placodermi. The oldest fossils appeared during the late Silurian, and became extinct at the end of the Devonian. Recent studies suggest that the placoderms are possibly a paraphyletic group of basal jawed fishes, and the closest relatives of all living jawed vertebrates. Some placoderms were small, flattened bottom-dwellers, such as antiarchs. However many, particularly the arthrodires, were active midwater predators. Dunkleosteus, which appeared later in the Devonian below, was the largest and most famous of these. The upper jaw was firmly fused to the skull, but there was a hinge joint between the skull and the bony plating of the trunk region. This allowed the upper part of the head to be thrown back and, in arthrodires, allowed them to take larger bites.",url:"http://www.dinosaurjungle.com/focus_placoderm.jpg"},{name:"Guiyu oneiros",description:"Guiyu oneiros, the earliest known bony fish. It has the combination of both ray-finned and lobe-finned features, although analysis of the totality of its features place it closer to lobe-finned fish.",url:"https://upload.wikimedia.org/wikipedia/commons/b/b5/Guiyu_BW.jpg"},{name:"Andreolepis",description:"The extinct genus Andreolepis includes the earliest known ray finned fish Andreolepis hedei, which appeared in the late Silurian, around 420 Ma.",url:"https://i.pinimg.com/originals/1a/fe/f2/1afef27c586608fd70272b0510ce200a.jpg"}]},{period:"Early Devonian",upper:"419 Mya",lower:"383 Mya",data:[{name:"Psarolepis",description:"Psarolepis (speckled scale) is a genus of extinct lobe-finned fish that lived around 397 to 418 Ma. Fossils of Psarolepis have been found mainly in South China and described by paleontologist Xiaobo Yu in 1998. It is not known for certain which group Psarolepis belongs, but paleontologists agree that it probably is a basal genus and seems to be close to the common ancestor of lobe-finned and ray-finned fishes.",url:"https://upload.wikimedia.org/wikipedia/commons/d/dc/Psarolepis_BW.jpg"},{name:"Holoptychius",description:"Holoptychius is an extinct genus from the order of porolepiform lobe-finned fish, extant from 416 to 359 Ma. It was a streamlined predator about 50 centimetres (20 in) long (though it could grow up to 2.5 m), which fed on other bony fish. Its rounded scales and body form indicate that it could have swum quickly through the water to catch prey. Similar to other rhipidistians, it had fang-like teeth on its palate in addition to smaller teeth on the jaws. Its asymmetrical tail sported a caudal fin on its lower end. To compensate for the downward push caused by this fin placement, Holoptychius's pectoral fins were placed high on the body.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/c/cf/Holoptychius_BW.jpg/400px-Holoptychius_BW.jpg"},{name:"Ptyctodontida",description:"The ptyctodontids (beak-teeth) are an extinct monotypic order of unarmored placoderms, containing only one family. They were extant from the start to the end of the Devonian. With their big heads, big eyes, and long bodies, the ptyctodontids bore a strong resemblance to modern day chimaeras (Holocephali). Their armor was reduced to a pattern of small plates around the head and neck. Like the extinct and related acanthothoracids, and the living and unrelated holocephalians, most of the ptyctodontids are thought to have lived near the sea bottom and preyed on shellfish.",url:"https://upload.wikimedia.org/wikipedia/commons/7/7f/Rhamphodopsis_threiplandi.jpg"},{name:"Petalichthyida",description:"The Petalichthyida was an order of small, flattened placoderms that existed from the beginning of the Devonian to the Late Devonian. They were typified by splayed fins and numerous tubercles that decorated all of the plates and scales of their armour. They reached a peak in diversity during the Early Devonian and were found throughout the world. Because they had compressed body forms, it is supposed they were bottom-dwellers that chased after or ambushed smaller fish. Their diet is not clear, as none of the fossil specimens found have preserved mouth parts.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/43/Lunaspis_broili.JPG/1200px-Lunaspis_broili.JPG"},{name:"Laccognathus",description:"Laccognathus (pitted jaw) was a genus of amphibious lobe-finned fish that existed 398–360 Ma. They were characterized by the three large pits (fossae) on the external surface of the lower jaw, which may have had sensory functions. Laccognathus grew to 1–2 metres (3–7 ft) in length. They had very short dorsoventrally flattened heads, less than one-fifth the length of the body. The skeleton was structured so large areas of skin were stretched over solid plates of bone. This bone was composed of particularly dense fibers – so dense that exchange of oxygen through the skin was unlikely. Rather, the dense ossifications served to retain water inside the body as Laccognathus traveled on land between bodies of water.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/0/07/Laccognathus_embryi_-_reconstruction.jpg/220px-Laccognathus_embryi_-_reconstruction.jpg"}]},{period:"Middle Devonian",upper:"393 Mya",lower:"383 Mya",data:[{name:"Dipterus",description:"Dipterus (two wings) is an extinct genus of lungfish from 376–361 Ma. It was about 35 centimetres (14 in) long, mostly ate invertebrates, and had lungs, not an air bladder. Like its ancestor Dipnorhynchus it had tooth-like plates on its palate instead of real teeth. However, unlike its modern relatives, in which the dorsal, caudal, and anal fin are fused into one, its fins were still separated. Otherwise Dipterus closely resembled modern lungfish.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/8/8b/Dipterus_NT.jpg/220px-Dipterus_NT.jpg"},{name:"Cheirolepis",description:'Cheirolepis (hand fin) was a genus of ray-finned fishes. It was among the most basal of the Devonian ray-finned fishes and is considered the first to possess the "standard" dermal cranial bones seen in later ray-finned fish. It was a predatory freshwater fish about 55 centimetres (22 in) long, and based on the size of its eyes it hunted by sight',url:"https://upload.wikimedia.org/wikipedia/commons/4/43/Cheirolepis.jpg"},{name:"Cladoselache",description:"Cladoselache was the first abundant genus of primitive shark, appearing about 370 Ma. It grew to 6 feet (1.8 m) long, with anatomical features similar to modern mackerel sharks. It had a streamlined body almost entirely devoid of scales, with five to seven gill slits and a short, rounded snout that had a terminal mouth opening at the front of the skull. It had a very weak jaw joint compared with modern-day sharks, but it compensated for that with very strong jaw-closing muscles. Its teeth were multi-cusped and smooth-edged, making them suitable for grasping, but not tearing or chewing. Cladoselache therefore probably seized prey by the tail and swallowed it whole. It had powerful keels that extended onto the side of the tail stalk and a semi-lunate tail fin, with the superior lobe about the same size as the inferior. This combination helped with its speed and agility, which was useful when trying to outswim its probable predator, the heavily armoured 10 metres (33 ft) long placoderm fish Dunkleosteus",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/23/Cladoselache_NT_small.jpg/220px-Cladoselache_NT_small.jpg"},{name:"Coccosteus",description:"Coccosteus (seed bone) is an extinct genus of arthrodire placoderm. The majority of fossils have been found in freshwater sediments, though they may have been able to enter saltwater. They grew up to 40 centimetres (16 in) long. Like all other arthrodires, Coccosteus had a joint between the armour of the body and skull. In addition, it also had an internal joint between its neck vertebrae and the back of the skull, allowing it to open its mouth even wider. Along with the longer jaws, this allowed Coccosteus to feed on fairly large prey. As with all other arthrodires, Coccosteus had bony dental plates embedded in its jaws, forming a beak. The beak was kept sharp by having the edges of the dental plates grind away at each other.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e3/Coccosteus_cuspidatus.jpg/220px-Coccosteus_cuspidatus.jpg"},{name:"Bothriolepis",description:"Bothriolepis (pitted scale) was the most successful genus of antiarch placoderms, if not the most successful genus of any placoderm, with over 100 species spread across Middle to Late Devonian strata across every continent.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/9/9a/Bothriolepis_NT_small.jpg/250px-Bothriolepis_NT_small.jpg"},{name:"Pituriaspida",description:"Pituriaspida (hallucinogenic shield) is a class containing two bizarre species of armoured jawless fishes with tremendous nose-like rostrums. They lived in estuaries around 390 Ma. The paleontologist Gavin Young, named the class after the hallucinogenic drug pituri, since he thought he might be hallucinating upon viewing the bizarre forms. The better studied species looked like a throwing-dart-like, with an elongate headshield and spear-like rostrum. The other species looked like a guitar pick with a tail, with a smaller and shorter rostrum and a more triangular headshield.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/0/08/Pituriaspida.jpg/220px-Pituriaspida.jpg"}]},{period:"Late Devonian",upper:"383 Mya",lower:"359 Mya",data:[{name:"Dunkleosteus",description:"Dunkleosteus is a genus of arthrodire placoderms that existed from 380 to 360 Ma. It grew up to 10 metres (33 ft) long and weighed up to 3.6 tonnes. It was a hypercarnivorous apex predator. Apart from its contemporary Titanichthys , no other placoderm rivalled it in size. Instead of teeth, Dunkleosteus had two pairs of sharp bony plates, which formed a beak-like structure. Apart from megalodon, it had the most powerful bite of any fish, generating bite forces in the same league as Tyrannosaurus rex and the modern crocodile.",url:"http://dinosaurtime.e2ecdn.co.uk/products/2301300-Dunkleosteus-with-Movable-Jaw-1.jpg?quality=85"},{name:"Titanichthys",description:"Titanichthys is a genus of giant, aberrant marine placoderm that lived in shallow seas. Many of the species approached Dunkleosteus in size and build. Unlike its relative, however, the various species of Titanichys had small, ineffective-looking mouth-plates that lacked a sharp cutting edge. It is assumed that Titanichthys was a filter feeder that used its capacious mouth to swallow or inhale schools of small, anchovy-like fish, or possibly krill-like zooplankton, and that the mouth-plates retained the prey while allowing the water to escape as it closed its mouth.",url:"https://upload.wikimedia.org/wikipedia/commons/0/01/Titanichthys10.jpg"},{name:"Materpiscis",description:"Materpiscis (mother fish) is a genus of ptyctodontid placoderm from about 380 Ma. Known from only one specimen, it is unique in having an unborn embryo present inside, and with remarkable preservation of a mineralised placental feeding structure (umbilical cord). This makes Materpiscis the first known vertebrate to show viviparity, or giving birth to live young. The specimen was named Materpiscis attenboroughi in honour of David Attenborough.",url:"https://upload.wikimedia.org/wikipedia/commons/7/78/Materpiscis.jpg"},{name:"Hyneria",description:"Hyneria is a genus of predatory lobe-finned fish, about 2.5 m (8.2 ft) long, that lived 360 million years ago.",url:"https://upload.wikimedia.org/wikipedia/commons/f/f3/Hyneria.jpg"},{name:"Rhizodonts",description:"Rhizodonts were an order of lobe-finned fish that survived to the end of the Carboniferous, 377–310 Ma. They reached huge sizes. The largest known species, Rhizodus hibberti grew up to 7 metres in length, making it the largest freshwater fish known.",url:"http://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/Rhizodopsis.jpg/440px-Rhizodopsis.jpg"},{name:"Eusthenopteron",description:"Genus of extinct lobe-finned fishes that has attained an iconic status from its close relationships to tetrapods. Early depictions of this animal show it emerging onto land, however paleontologists now widely agree that it was a strictly aquatic animal. The genus Eusthenopteron is known from several species that lived during the Late Devonian period, about 385 Ma. It was the object of intense study from the 1940s to the 1990s by the paleoichthyologist Erik Jarvik.",url:"https://upload.wikimedia.org/wikipedia/commons/2/24/Eusthenopteron_BW.jpg"},{name:"Gogonasus",description:"Gogonasus (snout from Gogo) was a lobe-finned fish known from 3-dimensionally preserved 380 million-year-old fossils found in the Gogo Formation. It was a small fish reaching 30–40 cm (0.98–1.31 ft) in length. Its skeleton shows several tetrapod-like features. They included the structure of its middle ear, and its fins show the precursors of the forearm bones, the radius and ulna. Researchers believe it used its forearm-like fins to dart out of the reef to catch prey. Gogonasus was first described in 1985 by John A. Long. For almost 100 years Eusthenopteron has been the role model for demonstrating stages in the evolution of lobe-finned fishes to tetrapods. Gogonasus now replaces Eusthenopteron in being a better preserved representative without any ambiguity in interpreting its anatomy.",url:"https://upload.wikimedia.org/wikipedia/commons/d/db/Gogonasus_BW.jpg"},{name:"Panderichthys",description:"Adapted to muddy shallows, and capable of some kind of shallow water or terrestrial body flexion locomotion. Had the ability to prop itself up.They had large tetrapod-like heads, and are thought to be the most crownward stem fish-tetrapod with paired fins.",url:"https://vignette.wikia.nocookie.net/dinosaurs/images/e/e3/PanderichthysNT.jpg/revision/latest?cb=20130620221410"},{name:"Tiktaalik",description:'A fish with limb-like fins that could take it onto land. It is an example from several lines of ancient sarcopterygian fish developing adaptations to the oxygen-poor shallow-water habitats of its time, which led to the evolution of tetrapods Paleontologists suggest that it is representative of the transition between non-tetrapod vertebrates (fish) such as Panderichthys, known from fossils 380 million years old, and early tetrapods such as Acanthostega and Ichthyostega, known from fossils about 365 million years old. Its mixture of primitive fish and derived tetrapod characteristics led one of its discoverers, Neil Shubin, to characterize Tiktaalik as a "fishapod".',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d4/Tiktaalik_NT_small.jpg/220px-Tiktaalik_NT_small.jpg"},{name:"Acanthostega",description:"A fish-like early labyrinthodont that occupied swamps and changed views about the early evolution of tetrapods. It had eight digits on each hand (the number of digits on the feet is unclear) linked by webbing, it lacked wrists, and was generally poorly adapted to come onto land. Subsequent discoveries revealed earlier transitional forms between Acanthostega and completely fish-like animals.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/21/Acanthostega_model.jpg/220px-Acanthostega_model.jpg"},{name:"Ichthyostega",description:"Until finds of other early tetrapods and closely related fishes in the late 20th century, Ichthyostega stood alone as the transitional fossil between fish and tetrapods, combining a fishlike tail and gills with an amphibian skull and limbs. It possessed lungs and limbs with seven digits that helped it navigate through shallow water in swamps.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/34/Ichthyostega_model.jpg/220px-Ichthyostega_model.jpg"},{name:"Pederpes",description:"Pederpes is the earliest known fully terrestrial tetrapod. It is included here to complete the transition of lobe-finned fishes to tetrapods, even though Pederpes is no longer a fish.",url:"https://upload.wikimedia.org/wikipedia/commons/f/fb/Pederpes22small.jpg"}]},{period:"Carboniferous",upper:"359 Mya",lower:"299 Mya",data:[{name:"Stethacanthidae",description:"As a result of the evolutionary radiation, carboniferous sharks assumed a wide variety of bizarre shapes—including sharks of the family Stethacanthidae, which possessed a flat brush-like dorsal fin with a patch of denticles on its top. Stethacanthus' unusual fin may have been used in mating rituals. Apart from the fins, Stethacanthidae resembled Falcatus .",url:"https://museumsvictoria.com.au/website/pages/17120/ImageGallery/pic-43020.jpg"},{name:"Falcatus",description:"Falcatus is a genus of small cladodont-toothed sharks that lived 335–318 Ma. They were about 25–30 cm (10–12 in) long. They are characterised by the prominent fin spines that curved anteriorly over their heads.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f1/Falcatus.jpg/220px-Falcatus.jpg"},{name:"Orodus",description:"Orodus is another shark of the Carboniferous, a genus from the family Orodontidae that lived into the early Permian from 303 to 295 Ma. It grew to 2 m (6.6 ft) in length.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/a/ac/Orodus_sp1DB.jpg/1200px-Orodus_sp1DB.jpg"}]},{period:"Permian",upper:"298 Mya",lower:"252 Mya",data:[{name:"Acanthodes",description:"Acanthodes are an extinct genus of spiny shark. It had gills but no teeth] and was presumably a filter feeder. Acanthodes had only two skull bones and were covered in cubical scales. Each paired pectoral and pelvic fins had one spine, as did the single anal and dorsal fins, giving it a total of six spines, less than half that of many other spiny sharks. Acanthodians share qualities of both bony fish (osteichthyes) and cartilaginous fish (chondrichthyes), and it has been suggested that they may have been stem chondrichthyans and stem gnathostomes.",url:"https://static.giantbomb.com/uploads/scale_small/13/132099/2555333-7936895969-15912.jpg"}]},{period:"Triassic",upper:"252 Mya",lower:"201 Mya",data:[{name:"Perleidus",description:"Perleidus was a ray-finned fish from the Early Triassic. About 15 centimetres (5.9 in) in length, it was a freshwater predatory fish with jaws that hung vertically under the braincase, allowing them to open wide. Perleidus had highly flexible dorsal and anal fins, with a reduced number of fin rays, which would have made the fish more agile in the water.",url:"https://upload.wikimedia.org/wikipedia/commons/f/f1/Perleidus.jpg"},{name:"Pachycormiformes",description:"Pachycormiformes are an extinct order of ray-finned fish that existed from the Middle Triassic to the K-Pg extinction. They were characterized by serrated pectoral fins, reduced pelvic fins and a bony rostrum. Their relations with other fish are unclear.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/44/Hypsocormus2.jpg/220px-Hypsocormus2.jpg"},{name:"Pholidophorus",description:"Pholidophorus was an extinct genus of teleost, around 40 centimetres (16 in) long, from about 240–140 Ma. Although not closely related to the modern herring, it was somewhat like them. It had a single dorsal fin, a symmetrical tail, and an anal fin placed towards the rear of the body. It had large eyes and was probably a fast swimming predator, hunting planktonic crustaceans and smaller fish. A very early teleost, Pholidophoris had many primitive characteristics such as ganoid scales and a spine that was partially composed of cartilage, rather than bone.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/f/f5/Pholidophorus_NT.jpg/220px-Pholidophorus_NT.jpg"}]},{period:"Jurassic",upper:"201 Mya",lower:"145 Mya",data:[{name:"Leedsichthys",description:"Along with its close pachycormid relatives Bonnerichthys and Rhinconichthys, Leedsichthys is part of a lineage of large-sized filter-feeders that swam the Mesozoic seas for over 100 million years, from the middle Jurassic until the end of the Cretaceous period. Pachycormids might represent an early branch of Teleostei, the group most modern bony fishes belong to; in that case Leedsichthys is the largest known teleost fish. In 2003, a fossil specimen 22 meters (72 feet) long was unearthed.",url:"https://upload.wikimedia.org/wikipedia/commons/9/98/Leedsichtys092.jpg"},{name:"Ichthyodectidae",description:'Ichthyodectidae was family of marine actinopterygian fish. They first appeared 156 Ma during the Late Jurassic and disappeared during the K-Pg extinction event 66 Ma. They were most diverse throughout the Cretaceous period. Sometimes classified in the primitive bony fish order Pachycormiformes, they are today generally regarded as members of the "bulldog fish" order Ichthyodectiformes in the far more advanced Osteoglossomorpha. Most ichthyodectids ranged between 1 and 5 meters (3.3 and 16.4 ft) in length. All known taxa were predators, feeding on smaller fish; in several cases, larger Ichthyodectidae preyed on smaller members of the family. Some species had remarkably large teeth, though others, such as Gillicus arcuatus, had small ones and sucked in their prey. The largest Xiphactinus was 20 feet long, and appeared in the Late Cretaceous ',url:"https://upload.wikimedia.org/wikipedia/commons/c/ce/Ichthyodectidae1.jpg"}]},{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:"Sturgeon",description:"True sturgeons appear in the fossil record during the Upper Cretaceous. Since that time, sturgeons have undergone remarkably little morphological change, indicating their evolution has been exceptionally slow and earning them informal status as living fossils. This is explained in part by the long generation interval, tolerance for wide ranges of temperature and salinity, lack of predators due to size, and the abundance of prey items in the benthic environment.",url:"https://seahistory.org/wp-content/uploads/Sturgeon.jpg"},{name:"Cretoxyrhina",description:"Cretoxyrhina mantelli was a large shark that lived about 100 to 82 million years ago, during the mid Cretaceous period. It is commonly known as the Ginsu Shark. This shark was first identified by a famous Swiss Naturalist, Louis Agassiz in 1843, as Cretoxyhrina mantelli. However, the most complete specimen of this shark was discovered in 1890, by the fossil hunter Charles H. Sternberg, who published his findings in 1907. The specimen consisted of a nearly complete associated vertebral column and over 250 associated teeth. This kind of exceptional preservation of fossil sharks is rare because a shark's skeleton is made of cartilage, which is not prone to fossilization. Charles dubbed the specimen Oxyrhina mantelli. This specimen represented a 20-foot-long (6.1 m) shark.",url:"https://upload.wikimedia.org/wikipedia/commons/a/a7/Cretoxyrhina_Ginsu_Shark.jpg"},{name:"Enchodus",description:'Enchodus is an extinct genus of bony fish. It flourished during the Upper Cretaceous and was small to medium in size. One of the genus\' most notable attributes are the large "fangs" at the front of the upper and lower jaws and on the palatine bones, leading to its misleading nickname among fossil hunters and paleoichthyologists, "the saber-toothed herring". These fangs, along with a long sleek body and large eyes, suggest Enchodus was a predatory species.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/de/Enchodus_petrosus.jpg/225px-Enchodus_petrosus.jpg"},{name:"Xiphactinus",description:"Xiphactinus is an extinct genus of large predatory marine bony fish of the Late Cretaceous. They grew more than 4.5 metres (15 feet) long.",url:"https://vignette.wikia.nocookie.net/river-monsters/images/9/94/Xiphactinus.jpg/revision/latest?cb=20170922230023"},{name:"Ptychodus",description:"Ptychodus is a genus of extinct hybodontiform shark that lived from the late Cretaceous to the Paleogene. Ptychodus mortoni (pictured) was about 32 feet (9.8 metres) long and was unearthed in Kansas, United States.",url:"https://upload.wikimedia.org/wikipedia/commons/3/31/Ptychodus_mortoni.jpg"}]},{period:"Cenozoic",upper:"66 Mya",lower:"present",data:[{name:"Amphistium",description:"Amphistium is a 50-million-year-old fossil fish that has been identified as an early relative of the flatfish, and as a transitional fossil. In a typical modern flatfish, the head is asymmetric with both eyes on one side of the head. In Amphistium, the transition from the typical symmetric head of a vertebrate is incomplete, with one eye placed near the top of the head.",url:"https://pre00.deviantart.net/f032/th/pre/i/2015/116/e/0/amphistium_paradoxum_by_avancna-d4il3yn.jpg"},{name:"Megalodon",description:"Megalodon is an extinct species of shark that lived about 28 to 1.5 Ma. It looked much like a stocky version of the great white shark, but was much larger with fossil lengths reaching 20.3 metres (67 ft). Found in all oceans, it was one of the largest and most powerful predators in vertebrate history, and probably had a profound impact on marine life.",url:"https://img.purch.com/w/660/aHR0cDovL3d3dy5saXZlc2NpZW5jZS5jb20vaW1hZ2VzL2kvMDAwLzEwMy8yNzgvb3JpZ2luYWwvbWVnYWxvZG9uLmpwZw=="}]}]}},e88a:function(e){e.exports={id:"insect",evolution_data:[{period:"Early Devonian",upper:"419 Mya",lower:"383 Mya",data:[{name:"Rhyniognatha hirsti",description:"The oldest definitive insect fossil is the Devonian Rhyniognatha hirsti, estimated at 407 to 396 million years ago. This species already possessed dicondylic (with two condyles, articulations) mandibles, a feature associated with winged insects, suggesting that wings may already have evolved at this time. Thus, the first insects probably appeared earlier, in the Silurian period. Like other insects of its time, Rhyniognatha presumably fed on plant sporophylls — which occur at the tips of branches and bear sporangia, the spore-producing organs. The insect’s anatomy might also give clues as to what it ate. The creature had large mandibles which may or may not have been used for hunting.",url:"http://eweb.furman.edu/~wworthen/bio440/evolweb/devonian/gnath1.jpg"}]},{period:"Late Devonian",upper:"383 Mya",lower:"359 Mya",data:[{name:"Strudiella devonica",description:"Strudiella devonica is a possible insect fossil, the first complete Late Devonian insect, probably terrestrial. It was recovered in the Strud (Gesves, Belgium) environment from the Bois des Mouches Formation, Upper Famennian. It had unspecialized, 'orthopteroid', mouthparts, indicating an omnivorous diet. This discovery reduces a previous gap of 45 million years in the evolutionary history of insects, part of the arthropod gap (the 'gap' still occurs in the early Carboniferous, coinciding and extending past the Romer's gap for tetrapods, which may have been caused by low oxygen levels in the atmosphere). Body segments, legs and antennae are visible; however, genitalia were not preserved. The insect has no wings, but it may be a juvenile.",url:"http://www.reflexions.uliege.be/upload/docs/image/png/2012-09/strudiella-devonica.png"}]},{period:"Carboniferous",upper:"359 Mya",lower:"299 Mya",data:[{name:"Blattoptera",description:'Blattoptera, or proto-cockroaches, is a name given to various "roachid" fossil insects related to cockroaches, mantises and termites, and of general cockroach-like appearance and possibly habit.The fossils assigned to the "roachids" are of general cockroach-like build, with a large disc-like pronotum covering most of the head, long antennae, legs built for running, flattened body and heavily veined wings with the distinct arched CuP-vein so typical of modern cockroach wings. Like modern cockroaches, the roachids were probably swift litter inhabitants living on a wide range of dead plant and animal matter. Contrary to modern forms, the female roachids all have a well-developed external ovipositor, a primitive insect trait. They probably inserted eggs singly into soil or crevices. The egg pods, called ootheca, seen in modern cockroaches and their relatives is a new shared trait separating them from their primitive ancestors. Some of the roachid species could reach relatively large sizes compared to most of their modern relatives, like the Carboniferous Archimylacris and the Permian Apthoroblattina, the latter who could reach 50 mm in body length. ',url:"https://farm4.staticflickr.com/3264/2853753987_2421502319_z.jpg?zz=1"},{name:"Caloneurodea",description:"A small order of neopterous insects with two similar pairs of wings and with legs adapted for running that appeared in the Upper Pennsylvanian and became extinct after the Permian",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/9/97/Caloneura_dowsoni.jpg/250px-Caloneura_dowsoni.jpg"},{name:["Ephemeropterans","Mayflies"],description:"Ephemeroptera is a group of 2,000 insect species commonly known as mayflies. They are considered to be part of the clade Uniramia which includes silverfish and dragonflies, among others. Ephemeroptera and Odonata are the only extant orders of winged insects in the infraclass Paleoptera. All other insects with wings are in the Neoptera, and are characterized by a wing articulation (joint) that allows them to fold their wings back over their abdomens at rest. Ephemeroptera are aquatic insects that often go through many nymph stages (living in water) and two flying stages (the subimago and the imago). They are the only insects to have two flying stages, and can be recognized by their three caudal filaments (tails) at the tip of the abdomen, and a single claw on each leg.",url:"http://tolweb.org/tree/ToLimages/Hexagenia1.200a.JPG"},{name:["Orthoptera","Grasshoppers","locusts","crickets"],description:'Orthoptera is an order of insects that comprises the grasshoppers, locusts and crickets, including closely related insects such as the katydids and wetas. The order is subdivided into two suborders: Caelifera – grasshoppers, locusts and close relatives; and Ensifera – crickets and close relatives.More than 20,000 species are distributed worldwide. The insects in the order have incomplete metamorphosis, and produce sound (known as a "stridulation") by rubbing their wings against each other or their legs, the wings or legs containing rows of corrugated bumps. The tympanum or ear is located in the front tibia in crickets, mole crickets, and katydids, and on the first abdominal segment in the grasshoppers and locusts. These organisms use vibrations to locate other individuals. Grasshoppers and other orthopterans are able to fold their wings (i.e. they are members of Neoptera)',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/b/bf/Metrioptera_roeseli_male_Richard_Bartz.jpg/220px-Metrioptera_roeseli_male_Richard_Bartz.jpg"},{name:"Palaeodictyopteroidea",description:"Palaeodictyopteroidea is a large and diverse group that includes 50% of all known Paleozoic insects. Containing many of the primitive features of the time: very long cerci, an ovipositor, and wings with little or no anal lobe. Protodonata, as its name implies, is a primitive paraphyletic group similar to Odonata; although lacks distinct features such as a nodus, a pterostigma and an arculus.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d7/Mazothairos1.jpg/220px-Mazothairos1.jpg"}]},{period:"Permian",upper:"298 Mya",lower:"252 Mya",data:[{name:["Proteytroptera","Dermaptera","Earwigs"],description:"Protelytroptera is an extinct order of insects thought to be a stem group from which the modern Dermaptera evolved. These insects, which resemble modern Blattodea, or Cockroaches, are known from the Permian of North America, Europe and Australia, from the fossils of their shell-like forewings and the large, unequal, anal fan. None of their fossils are known from the Triassic when the morphological changes from Protelytroptera to Dermaptera presumably took place.",url:"https://upload.wikimedia.org/wikipedia/commons/3/34/Earwig_on_white_background.jpg"},{name:["Plecoptera","Stoneflies"],description:"Some 3,500 species are described worldwide, with new species still being discovered. Stoneflies are found worldwide, except Antarctica. Stoneflies are believed to be one of the most primitive groups of Neoptera, with close relatives identified from the Carboniferous and Lower Permian geological periods, while true stoneflies are known from fossils only a bit younger. The modern diversity, however, apparently is of Mesozoic origin. \n Stoneflies have a generalized anatomy, with few specialized features compared to other insects. They have simple mouthparts with chewing mandibles, long, multiple-segmented antennae, large compound eyes, and two or three ocelli. The legs are robust, with each ending in two claws. The abdomen is relatively soft, and may include remnants of the nymphal gills even in the adult. Both nymphs and adults have long, paired cerci projecting from the tip of their abdomens",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/b/b1/SteinfliegenLarve2.JPG/220px-SteinfliegenLarve2.JPG"},{name:["Psocoptera","Booklice"],description:" They are often regarded as the most primitive of the hemipteroids.They range in size from 1–10 millimeters (0.04–0.4 in) in length.\n Psocids are small, scavenging insects with a relatively generalized body plan. They feed primarily on fungi, algae, lichen, and organic detritus in nature but are also known to feed on starch-based household items like grains, wallpaper glue and book bindings. They have chewing mandibles, and the central lobe of the maxilla is modified into a slender rod. This rod is used to brace the insect while it scrapes up detritus with its mandibles. They also have a swollen forehead, large compound eyes, and three ocelli. Their bodies are soft with a segmented abdomen. Some species can spin silk from glands in their mouth. They may festoon large sections of trunk and branches in dense swathes of silk.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/1/1e/Psocoptera.jpg/220px-Psocoptera.jpg"},{name:["Mecoptera","Scorpionfiles"],description:" These were mainly wind-pollinated plants, but fossil mecopterans had siphon-feeding apparatus that could have fertilized these early gymnosperms by feeding on their nectar and pollen. The lack of iron enrichment in their fossilized probosces rules out their use for drinking blood. Eleven species have been identified from three families, Mesopsychidae, Aneuretopsychidae, and Pseudopolycentropodidae within the clade Aneuretopsychina. Their lengths range from 3 mm (0.12 in) in Parapolycentropus burmiticus to 28 mm (1.1 in) in Lichnomesopsyche gloriae. The proboscis could be as long as 10 mm (0.39 in). It has been suggested that these mecopterans transferred pollen on their mouthparts and head surfaces, as do bee flies and hoverflies today, but no such associated pollen has been found, even when the insects were finely preserved in Eocene Baltic amber. They likely pollinated plants such as Caytoniaceae, Cheirolepidiaceae, and Gnetales, which have ovulate organs that are either poorly suited for wind pollination or have structures that could support long-proboscid fluid feeding. The Aneuretopsychina were the most diverse group of mecopterans in the Latest Permian, taking the place of the Permochoristidae, to the Middle Triassic.",url:"https://upload.wikimedia.org/wikipedia/commons/2/26/Skorpionsfliege_Panorpa_communis_male_full_%28cropped%29.jpg"},{name:["Coleoptera","Beetle"],description:" The oldest known fossil insect that unequivocally resembles a Coleopteran is from the Lower Permian Period about 270 million years ago (mya), though these members of the family Tshekardocoleidae have 13-segmented antennae, elytra with more fully developed venation and more irregular longitudinal ribbing, and abdomen and ovipositor extending beyond the apex of the elytra. In the Permian–Triassic extinction event at the end of the Permian, some 30% of all insect species became extinct, so the fossil record of insects only includes beetles from the Lower Triassic 220 mya. beetles often feed on plants and fungi, break down animal and plant debris, and eat other invertebrates. Some species are serious agricultural pests, such as the Colorado potato beetle, while others such as Coccinellidae (ladybirds or ladybugs) eat aphids, scale insects, thrips, and other plant-sucking insects that damage crops.",url:"http://lh6.ggpht.com/_X6JnoL0U4BY/S8FlVuGipBI/AAAAAAAAXqs/0VS_V6bM3EQ/tmp2016_thumb_thumb.jpg?imgmax=800"},{name:["Raphidioptera","Snakefly"],description:'Adult snakeflies are characterized by having an elongate prothorax but no modification of the forelegs (as in Mantispidae). They have strong and relatively unspecialised mouthparts, and large compound eyes. Some species also have ocelli. The females typically have a long ovipositor, which they use to deposit their eggs into crevices in bark or rotting wood. The two pair of dragonfly-like wings are similar in size, with a primitive venation pattern, and a thickened costal margin (or "pterostigma"). The larvae have large heads with projecting mandibles. The head and the first segment of the thorax are sclerotised, but the rest of the body is soft and fleshy. They have three pairs of true legs, but no prolegs. However, they do possess an adhesive organ on the abdomen, which they can use to fasten themselves to vertical surfaces.',url:"https://upload.wikimedia.org/wikipedia/commons/thumb/6/6d/Dichrostigma_flavipes_beentree.jpg/1200px-Dichrostigma_flavipes_beentree.jpg"},{name:["Neuroptera","Lacewings","mantidflies","antlions"],description:'Adult Neuropterans have four membranous wings, all about the same size, with many veins. They have chewing mouthparts, and undergo complete metamorphosis. Neuropterans first appeared during the Permian Period, and continued to diversify through the Mesozoic Era. During this time, several unusually large forms evolved, especially in the extinct family Kalligrammatidae, often referred to as "the butterflies of the Jurassic" due to their large, patterned wings. \n Neuropterans are soft-bodied insects with relatively few specialised features. They have large lateral compound eyes, and may or may not also have ocelli. Their mouthparts have strong mandibles suitable for chewing, and lack the various adaptations found in most other endopterygote insect groups.',url:"https://upload.wikimedia.org/wikipedia/commons/e/e0/Crisopid_July_2013-9a.jpg"}]},{period:"Triassic",upper:"252 Mya",lower:"201 Mya",data:[{name:"Beetle",description:"As a consequence of the Permian–Triassic extinction event, the fossil record of insects is scant, including beetles from the Lower Triassic. However, there are a few exceptions, such as in Eastern Europe. At the Babiy Kamen site in the Kuznetsk Basin, numerous beetle fossils were discovered, including entire specimens of the infraorders Archostemata (e.g. Ademosynidae, Schizocoleidae), Adephaga (e.g., Triaplidae, Trachypachidae) and Polyphaga (e.g. Hydrophilidae, Byrrhidae, Elateroidea). However, species from the families Cupedidae and Schizophoroidae are not present at this site, whereas they dominate at other fossil sites from the Lower Triassic such as Khey-Yaga, Russia, in the Korotaikha Basin.",url:"https://upload.wikimedia.org/wikipedia/commons/6/68/Tenomerga_mucida01.jpg"},{name:["Cercopidae","froghopper"],description:"Cercopidae are the largest family of Cercopoidea, a xylem-feeding insect group, commonly called froghoppers . They belong to the hemipteran suborder Auchenorrhyncha.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/3/3b/Blutzikade_Cercopis_vulnerata.jpg/1200px-Blutzikade_Cercopis_vulnerata.jpg"},{name:["Cicadellidae","leafhopper"],description:"These minute insects, colloquially known as hoppers, are plant feeders that suck plant sap from grass, shrubs, or trees. Their hind legs are modified for jumping, and are covered with hairs that facilitate the spreading of a secretion over their bodies that acts as a water repellent and carrier of pheromones. They undergo a partial metamorphosis, and have various host associations, varying from very generalized to very specific.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/Graphocephala_coccinea_6.jpg/290px-Graphocephala_coccinea_6.jpg"},{name:"Cixiidae",description:"The Cixiidae are a family of fulgoroid insects, one of many families commonly known as planthoppers, distributed worldwide and comprising more than 2,000 species from over 150 genera. The genera are placed into three subfamilies, Borystheninae, Bothriocerinae and Cixiinae with sixteen tribes currently accepted in Cixiinae. \n comparatively small (body size less than a centimeter) and usually inconspicuous. The face is longer than wide and the head is narrower than the pronotum. The forewings are at least partly transparent and the veins bear minute setae. The hind tibiae end in a cluster of spines and may sometimes have spines along their length. ",url:"https://upload.wikimedia.org/wikipedia/commons/8/89/Cixius.nervosus.-.lindsey.jpg"},{name:["Carabidae","Ground beetles"],description:"Ground beetles evolved in the latter Triassic, having separated from their closest relatives by 200 million years ago. Common habitats are under the bark of trees, under logs, or among rocks or sand by the edge of ponds and rivers. Most species are carnivorous and actively hunt for any invertebrate prey they can overpower.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/5/58/Dixussphaerocephalus.png/220px-Dixussphaerocephalus.png"},{name:["Anisopodidae","wood gnats","window-gnats"],description:"The Anisopodidae are small or medium-sized (mostly 4–12 mm, Lobogaster found in Chile 17–18 mm) yellowish to brownish gnats with long, thin legs. The tibiae have apical spurs. The head is small and rounded and with small mouthparts. The eyes are dichoptic or holoptic. Ocelli are present and form an equilateral triangle. The slender antennae vary from relatively short to longer than head and thorax together. The antennae have 14-16 segments. The mesonotum is without a transverse suture; the wing is wide, with a clear anal lobe and a pattern of smaller markings (sometimes hyaline). The alula is strongly differentiated in Olbiogaster and Sylvicola. Both wings lie flat over the abdomen in the resting position.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/4/4d/Sylvicola_fenestralis01.jpg/1200px-Sylvicola_fenestralis01.jpg"},{name:["Thysanoptera","thrips"],description:"The first Thysanoptera appeared during the Triassic period. Thrips (order Thysanoptera) are minute (most are 1 mm long or less), slender insects with fringed wings and unique asymmetrical mouthparts. Different thrips species feed mostly on plants by puncturing and sucking up the contents, although a few are predators. ",url:"https://upload.wikimedia.org/wikipedia/commons/2/2f/Thysanoptera.jpg"}]},{period:"Jurassic",upper:"201 Mya",lower:"145 Mya",data:[{name:"Beetles",description:"During the Jurassic (210 to 145 mya), there was a dramatic increase in the diversity of beetle families, including the development and growth of carnivorous and herbivorous species. The Chrysomeloidea diversified around the same time, feeding on a wide array of plant hosts from cycads and conifers to angiosperms.\n Around the same time, numerous primitive weevils (e.g. Curculionoidea) and click beetles (e.g. Elateroidea) appeared. The first jewel beetles (e.g. Buprestidae) are present, but they remained rare until the Cretaceous.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/8/86/Denticollis.linearis.2.jpg/240px-Denticollis.linearis.2.jpg"}]},{period:"Cretaceous",upper:"145 Mya",lower:"66 Mya",data:[{name:"beetles",description:"The diversity of Cupedidae and Archostemata decreased considerably. Predatory ground beetles (Carabidae) and rove beetles (Staphylinidae) began to distribute into different patterns.\n The diversity of jewel beetles increased rapidly, as they were the primary consumers of wood.\n The first species where both larvae and adults are adapted to an aquatic lifestyle are found. Whirligig beetles (Gyrinidae) were moderately diverse, although other early beetles (e.g. Dytiscidae) were less, with the most widespread being the species of Coptoclavidae, which preyed on aquatic fly larvae.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/e/e0/Cordalia_tsavoana_Pace%2C_2008_%282912937616%29.jpg/327px-Cordalia_tsavoana_Pace%2C_2008_%282912937616%29.jpg"},{name:"ant",description:"Ants evolved from a lineage within the stinging wasps.the fossil remains of an ant (Sphecomyrma) that lived in the Cretaceous period. The specimen, trapped in amber dating back to around 92 million years ago, has features found in some wasps, but not found in modern ants. Sphecomyrma was possibly a ground forager, while Haidomyrmex and Haidomyrmodes, related genera in subfamily Sphecomyrminae, are reconstructed as active arboreal predators. Older ants in the genus Sphecomyrmodes have been found in 99 million year-old amber from Myanmar.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/2/28/Sphecomyrma_freyi_AMNH-NJ943B.jpg/220px-Sphecomyrma_freyi_AMNH-NJ943B.jpg"}]},{period:"Paleogene",upper:"66 Mya",lower:"23 Mya",data:[{name:"ants",description:"Ants became dominant after adaptive radiation at the beginning of the Paleogene period. By the Oligocene and Miocene, ants had come to represent 20–40% of all insects found in major fossil deposits. Of the species that lived in the Eocene epoch, around one in 10 genera survive to the present. Genera surviving today comprise 56% of the genera in Baltic amber fossils (early Oligocene), and 92% of the genera in Dominican amber fossils (apparently early Miocene).",url:"https://1.bp.blogspot.com/-KbM5aWIfykI/XGgyr7ezUCI/AAAAAAAAMmA/iYlLu0Y2aYsi8zDjDxTo0KAzN1d2w5ZAQCLcBGAs/s1600/Drone-Ant-fossil-Eocene-epoch-Florissant-formation-Teller-County-Colorado-USA.jpg"},{name:"butterfly",description:" The earliest known butterfly fossils are from the mid Eocene epoch, between 40-50 million years ago.[dubious – discuss] Their development is closely linked to the evolution of flowering plants, since both adult butterflies and caterpillars feed on flowering plants. ",url:"https://upload.wikimedia.org/wikipedia/commons/b/bc/Prodryas.png"},{name:"beetle",description:" the beetle fauna of the Paleocene is comparatively poorly investigated. In contrast, the knowledge on the Eocene beetle fauna is very good. The reason is the occurrence of fossil insects in amber and clay slate sediments.",url:"https://upload.wikimedia.org/wikipedia/commons/thumb/d/d1/COLE_Belidae_Agathinus_tridens.png/220px-COLE_Belidae_Agathinus_tridens.png"}]},{period:"Neogene",upper:"23 Mya",lower:"Present",data:[{name:"beetle",description:"The most important sites for beetle fossils of the Neogene are situated in the warm temperate and to subtropical zones. One of the most important fossil sites for insects of the Pliocene is Willershausen near Göttingen, Germany with excellently preserved beetle fossils of various families (longhorn beetles, weevils, ladybugs and others) as well as representatives of other orders of insects. In the Willershausen clay pit so far 35 genera from 18 beetle families have been recorded, of which six genera are extinct. The Pleistocene beetle fauna is relatively well known, who used the composition of the beetle fauna to reconstruct climate conditions in the Rocky Mountains and on Beringia, the former land bridge between Asia and North America.",url:"http://warehouse1.indicia.org.uk/upload/p18sh5607ug4211ou15ip4u614fh7.jpg"}]}]}}}]);
